    'Other meat and edible meat offal, fresh, chilled or frozen' => 'Kita mėsa ir valgomieji mėsos subproduktai, švieži, atšaldyti arba užšaldyti',
    'Pig fat, free of lean meat, and poultry fat, not rendered or otherwise extracted, fresh, chilled, frozen, salted, in brine, dried or smoked' => 'Kiaulių riebalai be liesos mėsos ir naminių paukščių riebalai, nelydyti ar kitu būdu neekstrahuoti, švieži, atšaldyti, užšaldyti, sūdyti, užpilti sūrymu, džiovinti arba rūkyti',
    'Meat and edible meat offal, salted, in brine, dried or smoked; edible flours and meals of meat or meat offal' => 'Mėsa ir valgomieji mėsos subproduktai, sūdyti, užpilti sūrymu, džiovinti (vytinti) arba rūkyti; valgomieji mėsos arba mėsos subproduktų miltai ir rupiniai',
