    'Flours, meals and pellets of fish, crustaceans, molluscs and other aquatic invertebrates, fit for human consumption' => 'Žuvų, vėžiagyvių, moliuskų ir kitų vandens bestuburių miltai, rupiniai ir granulės, tinkami vartoti žmonių maistui',
