    'Whey, whether or not concentrated or containing added sugar or other sweetening matter; products consisting of natural milk constituents, whether or not containing added sugar or other sweetening matter, not elsewhere specified or included' => 'Išrūgos, koncentruotos arba nekoncentruotos, į kurias pridėta arba nepridėta cukraus ar kitų saldiklių; produktai iš natūralių pieno sudedamųjų dalių, į kuriuos pridėta arba nepridėta cukraus ar kitų saldiklių, nenurodyti kitoje vietoje',
