    'Skins and other parts of birds, with their feathers or down, feathers and parts of feathers (whether or not with trimmed edges) and down, not further worked than cleaned, disinfected or treated for preservation; powder and waste of feathers or parts of feathers' => 'Paukščių odos ir kitos jų kūno dalys su plunksnomis arba pūkais, plunksnos ir plunksnų dalys (su pakirptais arba nepakirptais kraštais) bei pūkai, toliau neapdoroti, išskyrus jų išvalymą, dezinfekavimą arba paruošimą laikyti; plunksnų arba plunksnų dalių milteliai ir atliekos',
