    'Other fruit, fresh' => 'Kiti vaisiai, švieži',
    'Fruit and nuts, uncooked or cooked by steaming or boiling in water, frozen, whether or not containing added sugar or other sweetening matter' => 'Vaisiai ir riešutai, nevirti arba išvirti garuose ar vandenyje, užšaldyti, į kuriuos pridėta arba nepridėta cukraus ar kitų saldiklių',
