    'Fats and oils and their fractions, of fish or marine mammals, whether or not refined, but not chemically modified' => 'Žuvų arba jūrų žinduolių taukai ir aliejus bei jų frakcijos, nerafinuoti arba rafinuoti, bet chemiškai nemodifikuoti',
