    'Other fixed vegetable or microbial fats and oils (including jojoba oil) and their fractions, whether or not refined, but not chemically modified' => 'Kiti nelakieji augaliniai arba mikroorganizmų riebalai ir aliejus (įskaitant simondsijų aliejų) bei jų frakcijos, nerafinuoti arba rafinuoti, bet chemiškai nemodifikuoti',
