    'Bread, pastry, cakes, biscuits and other bakers\' wares, whether or not containing cocoa; communion wafers, empty cachets of a kind suitable for pharmaceutical use, sealing wafers, rice paper and similar products' => 'Duona, pyragai, bandelės, pyragaičiai, sausainiai ir kiti kepiniai, su kakava arba be kakavos; ostijos ir kalėdaičiai, tuščios kapsulės, naudojamos farmacijoje, plokštieji vafliai, ryžinis popierius ir panašūs produktai',
    'Vegetables, fruit, nuts and other edible parts of plants, prepared or preserved by vinegar or acetic acid' => 'Daržovės, vaisiai, riešutai ir kitos valgomosios augalų dalys, paruoštos arba konservuotos su actu arba acto rūgštimi',
