    'Mushrooms and truffles, prepared or preserved otherwise than by vinegar or acetic acid' => 'Grybai ir trumai, paruošti arba konservuoti be acto arba acto rūgšties',
    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, frozen, other than products of heading 2006' => 'Kitos daržovės, paruoštos arba konservuotos be acto arba acto rūgšties, užšaldytos, išskyrus produktus, priskiriamus 2006 pozicijai',
    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, not frozen, other than products of heading 2006' => 'Kitos daržovės, paruoštos arba konservuotos be acto arba acto rūgšties, neužšaldytos, išskyrus produktus, priskiriamus 2006 pozicijai',
