    'Jams, fruit jellies, marmalades, fruit or nut purée and fruit or nut pastes, obtained by cooking, whether or not containing added sugar or other sweetening matter' => 'Džemai, vaisių drebučiai (želė), marmeladai, vaisių arba riešutų tyrės ir pastos, gauti virimo būdu, į kuriuos pridėta arba nepridėta cukraus ar kitų saldiklių',
    'Fruit, nuts and other edible parts of plants, otherwise prepared or preserved, whether or not containing added sugar or other sweetening matter or spirit, not elsewhere specified or included' => 'Vaisiai, riešutai ir kitos valgomosios augalų dalys, paruošti arba konservuoti kitais būdais, kurių sudėtyje yra pridėtojo cukraus ar kitų saldiklių arba alkoholio arba kurių sudėtyje nėra pridėtojo cukraus ar kitų saldiklių arba alkoholio, nenurodyti kitoje vietoje',
