    'Extracts, essences and concentrates, of coffee, tea or maté and preparations with a basis of these products or with a basis of coffee, tea or maté; roasted chicory and other roasted coffee substitutes, and extracts, essences and concentrates thereof' => 'Kavos, arbatos arba matės ekstraktai, esencijos ir koncentratai, taip pat produktai, daugiausia sudaryti iš šių produktų arba iš kavos, arbatos arba matės; skrudintos trūkažolės ir kiti skrudinti kavos pakaitalai, taip pat jų ekstraktai, esencijos ir koncentratai',
