    'Sauces and preparations therefor; mixed condiments and mixed seasonings; mustard flour and meal and prepared mustard' => 'Padažai ir jų pusgaminiai (koncentratai); sumaišyti uždarai ir sumaišyti pagardai; garstyčių miltai ir rupiniai bei paruoštos garstyčios',
