    'Waters, including natural or artificial mineral waters and aerated waters, not containing added sugar or other sweetening matter nor flavoured; ice and snow' => 'Vandenys, įskaitant gamtinius arba dirbtinius mineralinius vandenis, ir gazuotieji vandenys, į kuriuos nepridėta cukraus ar kitų saldiklių bei aromatinių medžiagų; ledas ir sniegas',
