    'Acyclic hydrocarbons' => 'Alifatiniai angliavandeniliai',
    'Cyclic hydrocarbons' => 'Cikliniai angliavandeniliai',
    'Halogenated derivatives of hydrocarbons' => 'Halogeninti angliavandenilių dariniai',
    'Sulphonated, nitrated or nitrosated derivatives of hydrocarbons, whether or not halogenated' => 'Sulfoninti, nitrinti arba nitrozinti angliavandenilių dariniai, halogeninti arba nehalogeninti',
    'Acyclic alcohols and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Alifatiniai alkoholiai ir jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Cyclic alcohols and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Cikliniai alkoholiai ir jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Phenols; phenol-alcohols' => 'Fenoliai; fenolalkoholiai',
    'Halogenated, sulphonated, nitrated or nitrosated derivatives of phenols or phenol-alcohols' => 'Halogeninti, sulfoninti, nitrinti arba nitrozinti fenolių arba fenolalkoholių dariniai',
    'Ethers, ether-alcohols, ether-phenols, ether-alcohol-phenols, alcohol peroxides, ether peroxides, acetal and hemiacetal peroxides, ketone peroxides (whether or not chemically defined), and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Eteriai, eteralkoholiai, eterfenoliai, eteralkoholfenoliai, alkoholių peroksidai, eterių peroksidai, acetalių peroksidai ir hemiacetalių peroksidai, ketonų peroksidai (chemijos atžvilgiu apibūdinti arba neapibūdinti) ir jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Epoxides, epoxyalcohols, epoxyphenols and epoxyethers, with a three-membered ring, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Epoksidai, epoksialkoholiai, epoksifenoliai ir epoksieteriai su trinariu žiedu ir jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Aldehydes, whether or not with other oxygen function; cyclic polymers of aldehydes; paraformaldehyde' => 'Aldehidai, kurių molekulėse yra arba nėra kitų deguoninių funkcinių grupių; cikliniai aldehidų polimerai; paraformaldehidas',
    'Ketones and quinones, whether or not with other oxygen function, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Ketonai ir chinonai, kurių molekulėse yra arba nėra kitų deguoninių funkcinių grupių, ir jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Saturated acyclic monocarboxylic acids and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Sočiosios alifatinės monokarboksirūgštys ir jų anhidridai, halogenidai, peroksidai ir peroksirūgštys; jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Unsaturated acyclic monocarboxylic acids, cyclic monocarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Nesočiosios alifatinės monokarboksirūgštys, ciklinės monokarboksirūgštys, jų anhidridai, halogenidai, peroksidai ir peroksirūgštys; jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Polycarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Polikarboksirūgštys, jų anhidridai, halogenidai, peroksidai ir peroksirūgštys; jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Carboxylic acids with additional oxygen function and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Karboksirūgštys, kurių molekulėse yra papildomoji deguoninė funkcinė grupė, ir jų anhidridai, halogenidai, peroksidai ir peroksirūgštys; jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Phosphoric esters and their salts, including lactophosphates; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Fosfato rūgšties esteriai ir jų druskos, įskaitant laktofosfatus; jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Esters of other inorganic acids of non-metals (excluding esters of hydrogen halides) and their salts; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Kitų nemetalų neorganinių rūgščių esteriai (išskyrus vandenilio halogenidų esterius) ir jų druskos; jų halogeninti, sulfoninti, nitrinti arba nitrozinti dariniai',
    'Amine-function compounds' => 'Junginiai, kurių molekulėse yra amino funkcinė grupė',
    'Oxygen-function amino-compounds' => 'Aminojunginiai, kurių molekulėse yra deguoninė funkcinė grupė',
    'Quaternary ammonium salts and hydroxides; lecithins and other phosphoaminolipids, whether or not chemically defined' => 'Ketvirtinės amonio druskos ir hidroksidai; lecitinai ir kiti fosfoaminolipidai, chemijos atžvilgiu apibūdinti arba neapibūdinti',
    'Carboxyamide-function compounds; amide-function compounds of carbonic acid' => 'Junginiai, kurių molekulėse yra karboksiamido funkcinė grupė; karbonato rūgšties (anglies rūgšties) junginiai, kurių molekulėse yra amido funkcinių grupių',
    'Carboxyimide-function compounds (including saccharin and its salts) and imine-function compounds' => 'Junginiai, kurių molekulėse yra karboksiimido funkcinė grupė (įskaitant sachariną ir jo druskas), taip pat junginiai, kurių molekulėse yra imino funkcinė grupė',
    'Nitrile-function compounds' => 'Junginiai, kurių molekulėse yra nitrilo funkcinė grupė',
    'Compounds with other nitrogen function' => 'Junginiai, kurių molekulėse yra kitų azotinių funkcinių grupių',
    'Organo-sulphur compounds' => 'Organiniai sieros junginiai',
    'Other organo-inorganic compounds' => 'Kiti organiniai-neorganiniai junginiai',
    'Heterocyclic compounds with oxygen hetero-atom(s) only' => 'Heterocikliniai junginiai, kurių molekulėse yra tik deguonies heteroatomas (-ai)',
    'Heterocyclic compounds with nitrogen hetero-atom(s) only' => 'Heterocikliniai junginiai, kurių molekulėse yra tik azoto heteroatomas (-ai)',
    'Nucleic acids and their salts, whether or not chemically defined; other heterocyclic compounds' => 'Nukleino rūgštys (nukleorūgštys) ir jų druskos, chemijos atžvilgiu apibūdintos arba neapibūdintos; kiti heterocikliniai junginiai',
    'Sulphonamides' => 'Sulfamidai',
    'Provitamins and vitamins, natural or reproduced by synthesis (including natural concentrates), derivatives thereof used primarily as vitamins, and intermixtures of the foregoing, whether or not in any solvent' => 'Provitaminai ir vitaminai, gamtiniai arba gauti sintezės būdu (įskaitant gamtinius koncentratus), jų dariniai, daugiausia vartojami kaip vitaminai, taip pat šių junginių mišiniai, ištirpinti bet kuriame tirpiklyje arba neištirpinti',
    'Hormones, prostaglandins, thromboxanes and leukotrienes, natural or reproduced by synthesis; derivatives and structural analogues thereof, including chain modified polypeptides, used primarily as hormones' => 'Hormonai, prostaglandinai, tromboksanai ir leukotrienai, gamtiniai arba gauti sintezės būdu; jų dariniai ir struktūriniai analogai, įskaitant polipeptidus su modifikuota grandine, daugiausia vartojami kaip hormonai',
    'Glycosides, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Glikozidai, gamtiniai arba gauti sintezės būdu, taip pat jų druskos, eteriai, esteriai ir kiti dariniai',
    'Alkaloids, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Alkaloidai, gamtiniai arba gauti sintezės būdu, taip pat jų druskos, eteriai, esteriai ir kiti dariniai',
    'Antibiotics' => 'Antibiotikai',
    'Glands and other organs for organo-therapeutic uses, dried, whether or not powdered; extracts of glands or other organs or of their secretions for organo-therapeutic uses; heparin and its salts; other human or animal substances prepared for therapeutic or prophylactic uses, not elsewhere specified or included' => 'Liaukos ir kiti organai, skirti naudoti organoterapijoje, džiovinti, sumalti į miltelius arba nemalti; liaukų arba kitų organų ar jų sekretų ekstraktai, skirti naudoti organoterapijoje; heparinas ir jo druskos; kitos žmogaus arba gyvūninės medžiagos, paruoštos naudoti terapijoje arba profilaktikoje, nenurodytos kitoje vietoje',
    'Human blood; animal blood prepared for therapeutic, prophylactic or diagnostic uses; antisera, other blood fractions and immunological products, whether or not modified or obtained by means of biotechnological processes; vaccines, toxins, cultures of micro-organisms (excluding yeasts) and similar products; cell cultures, whether or not modified' => 'Žmonių kraujas; gyvūnų kraujas, paruoštas naudoti terapijoje, profilaktikoje arba diagnostikoje; imuniniai serumai, kitos kraujo frakcijos ir imunologijos produktai, modifikuoti arba nemodifikuoti arba gauti naudojant biotechnologinius procesus arba jų nenaudojant; vakcinos, toksinai, mikroorganizmų kultūros (išskyrus mieles) ir panašūs produktai; ląstelių kultūros, modifikuotos arba nemodifikuotos',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of two or more constituents which have been mixed together for therapeutic or prophylactic uses, not put up in measured doses or in forms or packings for retail sale' => 'Medikamentai (išskyrus prekes, priskiriamas 3002, 3005 arba 3006 pozicijai), sudaryti iš ne mažiau kaip dviejų komponentų, tarpusavyje sumaišytų, kad tiktų naudoti terapijoje arba profilaktikoje, nesudozuoti, nesuformuoti ir nesupakuoti į mažmeninei prekybai skirtas pakuotes',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of mixed or unmixed products for therapeutic or prophylactic uses, put up in measured doses (including those in the form of transdermal administration systems) or in forms or packings for retail sale' => 'Medikamentai (išskyrus prekes, priskiriamas 3002, 3005 arba 3006 pozicijai), sudaryti iš sumaišytų arba nesumaišytų produktų, skirtų naudoti terapijoje arba profilaktikoje, sudozuoti (įskaitant formas, skirtas įvesti per odą), suformuoti arba supakuoti į mažmeninei prekybai skirtas pakuotes',
    'Wadding, gauze, bandages and similar articles (for example, dressings, adhesive plasters, poultices), impregnated or coated with pharmaceutical substances or put up in forms or packings for retail sale for medical, surgical, dental or veterinary purposes' => 'Vata, marlė, bandažai ir panašūs dirbiniai (pavyzdžiui, tvarsliava, pleistrai, kompresai), įmirkyti arba padengti farmacinėmis medžiagomis arba suformuoti arba supakuoti į mažmeninei prekybai skirtas pakuotes, kad būtų naudojami medicinos, chirurgijos, stomatologijos arba veterinarijos tikslams',
    'Pharmaceutical goods specified in note 4 to this chapter' => 'Farmacijos prekės, nurodytos šio skirsnio 4 pastaboje',
    'Mineral or chemical fertilisers, nitrogenous' => 'Mineralinės arba cheminės azoto trąšos',
    'Mineral or chemical fertilisers, phosphatic' => 'Mineralinės arba cheminės fosforo trąšos',
    'Mineral or chemical fertilisers, potassic' => 'Mineralinės arba cheminės kalio trąšos',
    'Mineral or chemical fertilisers containing two or three of the fertilising elements nitrogen, phosphorus and potassium; other fertilisers; goods of this chapter in tablets or similar forms or in packages of a gross weight not exceeding 10 kg' => 'Mineralinės arba cheminės trąšos, kurių sudėtyje yra du arba trys trąšų elementai: azotas, fosforas ir kalis; kitos trąšos; prekės, priskiriamos šiam skirsniui, turinčios tablečių arba panašių formų pavidalą arba supakuotos į pakuotes, kurių bruto masė ne didesnė kaip 10 kg',
    'Tanning extracts of vegetable origin; tannins and their salts, ethers, esters and other derivatives' => 'Augaliniai rauginimo ekstraktai; taninai ir jų druskos, eteriai, esteriai ir kiti dariniai',
    'Synthetic organic tanning substances; inorganic tanning substances; tanning preparations, whether or not containing natural tanning substances; enzymatic preparations for pre-tanning' => 'Sintetinės organinės rauginimo medžiagos; neorganinės rauginimo medžiagos; rauginimo preparatai, kurių sudėtyje yra arba nėra gamtinių rauginimo medžiagų; fermentiniai (enziminiai) parengiamojo rauginimo preparatai',
    'Colouring matter of vegetable or animal origin (including dyeing extracts but excluding animal black), whether or not chemically defined; preparations as specified in note 3 to this chapter based on colouring matter of vegetable or animal origin' => 'Augalinės arba gyvūninės dažiosios medžiagos (įskaitant dažiuosius ekstraktus, bet išskyrus kaulų suodžius), chemijos atžvilgiu apibūdintos arba neapibūdintos; preparatai, nurodyti šio skirsnio 3 pastaboje, kurių pagrindinė sudėtinė dalis yra gyvūninė arba augalinė dažioji medžiaga',
    'Synthetic organic colouring matter, whether or not chemically defined; preparations as specified in note 3 to this chapter based on synthetic organic colouring matter; synthetic organic products of a kind used as fluorescent brightening agents or as luminophores, whether or not chemically defined' => 'Sintetinės organinės dažiosios medžiagos, chemijos atžvilgiu apibūdintos arba neapibūdintos; preparatai, nurodyti šio skirsnio 3 pastaboje, kurių pagrindinė sudėtinė dalis yra sintetinė organinė dažioji medžiaga; sintetiniai organiniai produktai, naudojami kaip fluorescuojančios balinimo medžiagos arba liuminoforai, chemijos atžvilgiu apibūdinti arba neapibūdinti',
    'Other colouring matter; preparations as specified in note 3 to this chapter, other than those of heading 3203, 3204 or 3205; inorganic products of a kind used as luminophores, whether or not chemically defined' => 'Kitos dažiosios medžiagos; preparatai, nurodyti šio skirsnio 3 pastaboje, išskyrus priskiriamus 3203, 3204 arba 3205 pozicijai; neorganiniai produktai, naudojami kaip liuminoforai, chemijos atžvilgiu apibūdinti arba neapibūdinti',
    'Prepared pigments, prepared opacifiers and prepared colours, vitrifiable enamels and glazes, engobes (slips), liquid lustres and similar preparations, of a kind used in the ceramic, enamelling or glass industry; glass frit and other glass, in the form of powder, granules or flakes' => 'Paruošti pigmentai, paruošti drumstikliai ir paruošti dažai, stiklėjantys emaliai ir glazūros, angobai (šlikeriai), skysti blizgikliai ir panašūs preparatai, naudojami keramikos, emaliuotų dirbinių ir stiklo pramonėje; stiklo fritas ir kitas stiklas, turintis miltelių, granulių arba dribsnių pavidalą',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in a non-aqueous medium; solutions as defined in note 4 to this chapter' => 'Dažai ir lakai (įskaitant emalius ir politūras), kurių pagrindinės sudėtinės dalys yra sintetiniai polimerai arba chemiškai modifikuoti gamtiniai polimerai, disperguoti arba ištirpinti nevandeninėje terpėje; tirpalai, apibrėžti šio skirsnio 4 pastaboje',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in an aqueous medium' => 'Dažai ir lakai (įskaitant emalius ir politūras), kurių pagrindinės sudėtinės dalys yra sintetiniai polimerai arba chemiškai modifikuoti gamtiniai polimerai, disperguoti arba ištirpinti vandeninėje terpėje',
    'Other paints and varnishes (including enamels, lacquers and distempers); prepared water pigments of a kind used for finishing leather' => 'Kiti dažai ir lakai (įskaitant emalius, politūras ir klijinius dažus); paruošti vandeniniai pigmentai, naudojami odų apdailai',
    'Pigments (including metallic powders and flakes) dispersed in non-aqueous media, in liquid or paste form, of a kind used in the manufacture of paints (including enamels); stamping foils; dyes and other colouring matter put up in forms or packings for retail sale' => 'Pigmentai (įskaitant metalo miltelius ir dribsnius), disperguoti nevandeninėje terpėje, turintys skysčio arba pastos pavidalą, naudojami dažų (įskaitant emalius) gamyboje; spaudos folija; dažikliai ir kitos dažiosios medžiagos, suformuotos į formas arba supakuotos į mažmeninei prekybai skirtas pakuotes',
    'Artists\', students\' or signboard painters\' colours, modifying tints, amusement colours and the like, in tablets, tubes, jars, bottles, pans or in similar forms or packings' => 'Dailininkams, mokiniams arba iškabų apipavidalintojams skirti dažai, atspalvių modifikavimo priemonės, pramogoms skirti dažai ir panašūs dažai, pateikiami tabletėmis, tūbelėse, stiklainiuose, buteliuose, kaušeliuose ir panašiai suformuoti arba supakuoti',
    'Glaziers\' putty, grafting putty, resin cements, caulking compounds and other mastics; painters\' fillings; non-refractory surfacing preparations for façades, indoor walls, floors, ceilings or the like' => 'Langų glaistai, sodo tepalai, kanifolijos glaistai, sandarinimo mišiniai ir kitos mastikos; gruntai; ugniai neatsparios fasadų, vidinių sienų, grindų, lubų arba panašios dangos',
    'Printing ink, writing or drawing ink and other inks, whether or not concentrated or solid' => 'Spaustuviniai dažai, rašymo ir piešimo rašalai ar tušai bei kiti rašalai ar tušai, koncentruoti arba nekoncentruoti, kieti arba nekieti',
    'Essential oils (terpeneless or not), including concretes and absolutes; resinoids; extracted oleoresins; concentrates of essential oils in fats, in fixed oils, in waxes or the like, obtained by enfleurage or maceration; terpenic by-products of the deterpenation of essential oils; aqueous distillates and aqueous solutions of essential oils' => 'Eteriniai aliejai (deterpenuoti arba nedeterpenuoti), įskaitant konkretus ir absoliutus; kvapieji dervų ekstraktai (rezinoidai); ekstrahuotosios aliejingos dervos (oleorezinai); eterinių aliejų koncentratai riebaluose, nelakiuosiuose aliejuose, vaškuose arba panašiose medžiagose, gauti anfleražo arba maceravimo būdu; šalutiniai terpeniniai eterinių aliejų deterpenacijos produktai; eterinių aliejų vandeniniai distiliatai ir vandeniniai tirpalai',
    'Mixtures of odoriferous substances and mixtures (including alcoholic solutions) with a basis of one or more of these substances, of a kind used as raw materials in industry; other preparations based on odoriferous substances, of a kind used for the manufacture of beverages' => 'Kvapiųjų medžiagų mišiniai ir mišiniai (įskaitant alkoholinius tirpalus), kurių pagrindiniai komponentai yra viena arba kelios tokios medžiagos, naudojami pramonėje kaip žaliavos; kiti preparatai, kurių pagrindiniai komponentai yra kvapiosios medžiagos, naudojamos gėrimų gamyboje',
    'Perfumes and toilet waters' => 'Kvepalai ir tualetiniai vandenys',
    'Beauty or make-up preparations and preparations for the care of the skin (other than medicaments), including sunscreen or suntan preparations; manicure or pedicure preparations' => 'Gražinimosi arba makiažo priemonės ir odos priežiūros priemonės (išskyrus medikamentus), įskaitant apsaugos nuo įdegimo arba įdegimo imitavimo priemones; manikiūro ir pedikiūro priemonės',
    'Preparations for use on the hair' => 'Plaukų priemonės',
    'Preparations for oral or dental hygiene, including denture fixative pastes and powders; yarn used to clean between the teeth (dental floss), in individual retail packages' => 'Burnos ertmės arba dantų higienos preparatai, įskaitant dantų protezų įtvirtinimo pastas ir miltelius; supakuoti į atskiras mažmeninei prekybai skirtas pakuotes',
    'Pre-shave, shaving or aftershave preparations, personal deodorants, bath preparations, depilatories and other perfumery, cosmetic or toilet preparations, not elsewhere specified or included; prepared room deodorisers, whether or not perfumed or having disinfectant properties' => 'Priemonės, naudojamos prieš skutimąsi, skutimosi metu arba po skutimosi, kūno dezodorantai, vonios priemonės, depiliatoriai ir kitos parfumerijos, kosmetikos arba tualetinės priemonės, nenurodytos kitoje vietoje; paruošti patalpų oro gaivikliai, kvepinti arba nekvepinti, turintys arba neturintys dezinfekcinių savybių',
    'Soap; organic surface-active products and preparations for use as soap, in the form of bars, cakes, moulded pieces or shapes, whether or not containing soap; organic surface-active products and preparations for washing the skin, in the form of liquid or cream and put up for retail sale, whether or not containing soap; paper, wadding, felt and nonwovens, impregnated, coated or covered with soap or detergent' => 'Muilas; organinės paviršinio aktyvumo medžiagos ir preparatai, skirti naudoti kaip muilas, turintys gabalėlių, luitų, lietinių dirbinių arba formų pavidalą, kurių sudėtyje yra arba nėra muilo; organinės paviršinio aktyvumo medžiagos ir preparatai, kurių sudėtyje yra arba nėra muilo, skirti odai plauti, turintys skysčio arba kremo pavidalą, supakuoti į mažmeninei prekybai skirtas pakuotes; popierius, vata, veltinys ir neaustinės medžiagos, įmirkytos arba padengtos muilu arba plovikliu',
    'Organic surface-active agents (other than soap); surface-active preparations, washing preparations (including auxiliary washing preparations) and cleaning preparations, whether or not containing soap, other than those of heading 3401' => 'Organinės paviršinio aktyvumo medžiagos (išskyrus muilą); paviršinio aktyvumo preparatai, skalbikliai (įskaitant pagalbinius skalbiklius) ir valikliai, kurių sudėtyje yra arba nėra muilo, išskyrus priskiriamus 3401 pozicijai',
    'Lubricating preparations (including cutting-oil preparations, bolt or nut release preparations, anti-rust or anti-corrosion preparations and mould-release preparations, based on lubricants) and preparations of a kind used for the oil or grease treatment of textile materials, leather, furskins or other materials, but excluding preparations containing, as basic constituents, 70 % or more by weight of petroleum oils or of oils obtained from bituminous minerals' => 'Tepimo priemonės (įskaitant pjovimo įrankių aušinimo skysčius, varžtų ir veržlių atpalaidavimo preparatus, priemones nuo rūdijimo arba antikorozinius preparatus ir preparatus, skirtus išėmimui iš formų palengvinti, daugiausia pagamintus iš tepalų), taip pat preparatai, naudojami tekstilės medžiagoms, odoms, kailiams arba kitoms medžiagoms apdoroti alyvomis arba riebalais, bet išskyrus preparatus, kurių pagrindinės sudėtinės dalys, sudarančios ne mažiau kaip 70 % masės, yra naftos alyvos arba alyvos, gautos iš bituminių mineralų',
    'Artificial waxes and prepared waxes' => 'Dirbtiniai vaškai ir paruošti vaškai',
    'Polishes and creams, for footwear, furniture, floors, coachwork, glass or metal, scouring pastes and powders and similar preparations (whether or not in the form of paper, wadding, felt, nonwovens, cellular plastics or cellular rubber, impregnated, coated or covered with such preparations), excluding waxes of heading 3404' => 'Blizginimo priemonės ir kremai, skirti avalynės, baldų, grindų, kėbulų, stiklo arba metalo priežiūrai, šveitimo pastos ir milteliai bei panašios priemonės (turinčios popieriaus, vatos, veltinio, neaustinių medžiagų, akytų plastikų arba akytos gumos, įmirkytų, vilktų arba dengtų šiomis priemonėmis arba kitą pavidalą), išskyrus vaškus, priskiriamus 3404 pozicijai',
    'Casein, caseinates and other casein derivatives; casein glues' => 'Kazeinas, kazeinatai ir kiti kazeino dariniai; kazeininiai klijai',
    'Albumins (including concentrates of two or more whey proteins, containing by weight more than 80 % whey proteins, calculated on the dry matter), albuminates and other albumin derivatives' => 'Albuminai (įskaitant dviejų arba daugiau išrūgų baltymų koncentratus, kurių sudėtyje išrūgų baltymai sudaro daugiau kaip 80 % sausojo produkto masės), albuminatai ir kiti albuminų dariniai',
    'Gelatin (including gelatin in rectangular (including square) sheets, whether or not surface-worked or coloured) and gelatin derivatives; isinglass; other glues of animal origin, excluding casein glues of heading 3501' => 'Želatina (įskaitant želatiną, turinčią stačiakampių (įskaitant kvadratinius) lakštų pavidalą, apdirbtu arba neapdirbtu paviršiumi, dažytą arba nedažytą) ir želatinos dariniai; žuvų klijai; kiti gyvūniniai klijai, išskyrus kazeininius klijus, priskiriamus 3501 pozicijai',
    'Peptones and their derivatives; other protein substances and their derivatives, not elsewhere specified or included; hide powder, whether or not chromed' => 'Peptonai ir jų dariniai; kitos baltyminės medžiagos ir jų dariniai, nenurodyti kitoje vietoje; odos milteliai, chromuoti arba nechromuoti',
    'Dextrins and other modified starches (for example, pregelatinised or esterified starches); glues based on starches, or on dextrins or other modified starches' => 'Dekstrinai ir kiti modifikuoti krakmolai (pavyzdžiui, paželatinuoti arba esterinti krakmolai); klijai, daugiausia sudaryti iš krakmolų, dekstrinų arba kitų modifikuotų krakmolų',
    'Prepared glues and other prepared adhesives, not elsewhere specified or included; products suitable for use as glues or adhesives, put up for retail sale as glues or adhesives, not exceeding a net weight of 1 kg' => 'Paruošti klijai ir kiti paruošti adhezyvai, nenurodyti kitoje vietoje; produktai, tinkami naudoti kaip klijai arba adhezyvai, pateikiami mažmeninei prekybai kaip klijai arba adhezyvai, kurių neto masė ne didesnė kaip 1 kg',
    'Enzymes; prepared enzymes not elsewhere specified or included' => 'Fermentai (enzimai); paruošti fermentai (enzimai), nenurodyti kitoje vietoje',
    'Safety fuses; detonating cords; percussion or detonating caps; igniters; electric detonators' => 'Degtuvai; detonuojamosios virvės; sprogdinimo arba padegimo kapsulės; degikliai; elektriniai detonatoriai',
    'Fireworks, signalling flares, rain rockets, fog signals and other pyrotechnic articles' => 'Fejerverkai, signalinės raketos, lietaus raketos, rūko signalai ir kiti pirotechnikos gaminiai',
    'Ferro-cerium and other pyrophoric alloys in all forms; articles of combustible materials as specified in note 2 to this chapter' => 'Feroceris ir kiti visų formų piroforiniai lydiniai; degiųjų medžiagų dirbiniai, nurodyti šio skirsnio 2 pastaboje',
    'Photographic plates and film in the flat, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in the flat, sensitised, unexposed, whether or not in packs' => 'Fotoplokštelės ir fotojuostos, plokščios, įjautrintos, neeksponuotos, pagamintos iš bet kurių medžiagų, išskyrus popierių, kartoną ir tekstilės medžiagas; momentinės fotografijos juostos, plokščios, įjautrintos, neeksponuotos, įdėtos arba neįdėtos į kasetes',
    'Photographic film in rolls, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in rolls, sensitised, unexposed' => 'Ritinėlių pavidalo fotojuostos, įjautrintos, neeksponuotos, pagamintos iš bet kurių medžiagų, išskyrus popierių, kartoną ir tekstilės medžiagas; ritinėlių pavidalo momentinės fotografijos juostos, įjautrintos, neeksponuotos',
    'Photographic paper, paperboard and textiles, sensitised, unexposed' => 'Fotografijos popierius, kartonas ir tekstilės medžiagos, įjautrinti, neeksponuoti',
    'Photographic plates, film, paper, paperboard and textiles, exposed but not developed' => 'Fotografijos plokštelės, juostos, popierius, kartonas ir tekstilės medžiagos, eksponuotos, bet neišryškintos',
    'Photographic plates and film, exposed and developed, other than cinematographic film' => 'Fotografijos plokštelės ir juostos, eksponuotos ir išryškintos, išskyrus kino juostas',
    'Cinematographic film, exposed and developed, whether or not incorporating soundtrack or consisting only of soundtrack' => 'Kino juostos, eksponuotos ir išryškintos, su garso takeliu ar be garso takelio, arba sudarytos tik iš garso takelio',
    'Chemical preparations for photographic uses (other than varnishes, glues, adhesives and similar preparations); unmixed products for photographic uses, put up in measured portions or put up for retail sale in a form ready for use' => 'Cheminiai preparatai, skirti naudoti fotografijoje (išskyrus lakus, klijus, adhezyvus ir panašius preparatus); nesumaišyti produktai, skirti naudoti fotografijoje, sufasuoti išmatuotais santykiniais kiekiais arba turintys paruoštų naudoti produktų, skirtų mažmeninei prekybai, pavidalą',
    'Artificial graphite; colloidal or semi-colloidal graphite; preparations based on graphite or other carbon in the form of pastes, blocks, plates or other semi-manufactures' => 'Dirbtinis grafitas; koloidinis arba pusiau koloidinis grafitas; preparatai, kurių pagrindinės sudėtinės dalys yra grafitas arba kitos anglies atmainos, turintys pastų, luitų, plokščių arba kitų pusgaminių pavidalą',
    'Activated carbon; activated natural mineral products; animal black, including spent animal black' => 'Aktyvintos anglys; aktyvinti gamtiniai mineraliniai produktai; gyvūninės anglys, įskaitant panaudotas gyvūnines anglis',
    'Tall oil, whether or not refined' => 'Talo alyva, rafinuota arba nerafinuota',
    'Gum, wood or sulphate turpentine and other terpenic oils produced by the distillation or other treatment of coniferous woods; crude dipentene; sulphite turpentine and other crude para-cymene; pine oil containing alpha-terpineol as the main constituent' => 'Sakų, medienos arba sulfatinis terpentinas ir kiti terpeniniai aliejai, gauti distiliuojant arba kitu būdu apdorojant spygliuočių medieną; neapdorotas dipentenas; sulfitinis terpentinas ir kiti neapdoroti para-cimenai; pušų aliejus, kurio pagrindinė sudėtinė dalis yra alfa-terpineolis',
    'Rosin and resin acids, and derivatives thereof; rosin spirit and rosin oils; run gums' => 'Kanifolija ir kanifolijos rūgštys bei jų dariniai; kanifolijos spiritas ir kanifolijos alyvos; takiosios dervos',
    'Wood tar; wood tar oils; wood creosote; wood naphtha; vegetable pitch; brewers\' pitch and similar preparations based on rosin, resin acids or on vegetable pitch' => 'Degutas; deguto alyvos; medienos kreozotas; medienos alyva (wood naphtha); augalinis pikis; alaus pikis ir panašūs preparatai, kurių pagrindinės sudėtinės dalys yra kanifolija, kanifolijos rūgštys arba augalinis pikis',
    'Insecticides, rodenticides, fungicides, herbicides, anti-sprouting products and plant-growth regulators, disinfectants and similar products, put up in forms or packings for retail sale or as preparations or articles (for example, sulphur-treated bands, wicks and candles, and fly-papers)' => 'Insekticidai, rodenticidai, fungicidai, herbicidai, augalų dygimo lėtikliai ir augalų augimo reguliatoriai, dezinfekcijos priemonės ir panašūs produktai, suformuoti į formas arba supakuoti į mažmeninei prekybai skirtas pakuotes, arba turintys preparatų arba dirbinių pavidalą (pavyzdžiui, siera apdorotos juostos, dagčiai ir žvakės bei lipnūs musgaudžiai)',
    'Finishing agents, dye carriers to accelerate the dyeing or fixing of dyestuffs and other products and preparations (for example, dressings and mordants), of a kind used in the textile, paper, leather or like industries, not elsewhere specified or included' => 'Apdailos agentai, priemonės, naudojamos dažymui arba dažiklių fiksacijai pagreitinti, ir kiti produktai bei preparatai (pavyzdžiui, užpildai ir kandikai), naudojami tekstilės, popieriaus, odos pramonėje arba panašiose pramonės šakose, nenurodyti kitoje vietoje',
    'Pickling preparations for metal surfaces; fluxes and other auxiliary preparations for soldering, brazing or welding; soldering, brazing or welding powders and pastes consisting of metal and other materials; preparations of a kind used as cores or coatings for welding electrodes or rods' => 'Metalo paviršių ėsdinimo preparatai (beicai); fliusai ir kiti pagalbiniai preparatai, skirti litavimui, litavimui kietuoju lydmetaliu arba virinimui; litavimo, litavimo kietuoju lydmetaliu arba suvirinimo milteliai ir pastos iš metalų ir iš kitų medžiagų; preparatai, naudojami suvirinimo elektrodų arba strypų šerdims ar apvalkalams',
    'Anti-knock preparations, oxidation inhibitors, gum inhibitors, viscosity improvers, anti-corrosive preparations and other prepared additives, for mineral oils (including gasoline) or for other liquids used for the same purposes as mineral oils' => 'Antidetonaciniai preparatai, oksidacijos inhibitoriai, dervų susidarymo inhibitoriai, tirštikliai, antikoroziniai preparatai ir kiti paruošti alyvų (įskaitant benziną) arba kitų skysčių, naudojamų tiems patiems tikslams kaip ir alyvos, priedai',
    'Prepared rubber accelerators; compound plasticisers for rubber or plastics, not elsewhere specified or included; anti-oxidising preparations and other compound stabilisers for rubber or plastics' => 'Paruošti vulkanizacijos greitikliai; sudėtiniai kaučiuko arba plastikų plastifikatoriai, nenurodyti kitoje vietoje; antioksidacijos preparatai ir kiti sudėtiniai kaučiuko arba plastikų stabilizatoriai',
    'Organic composite solvents and thinners, not elsewhere specified or included; prepared paint or varnish removers' => 'Sudėtiniai organiniai tirpikliai ir skiedikliai, nenurodyti kitoje vietoje; paruoštos dažų arba lakų šalinimo priemonės',
    'Reaction initiators, reaction accelerators and catalytic preparations, not elsewhere specified or included' => 'Reakcijų iniciatoriai, reakcijų greitikliai ir kataliziniai preparatai, nenurodyti kitoje vietoje',
    'Refractory cements, mortars, concretes and similar compositions, including dolomite ramming mix, other than products of heading 3801' => 'Ugniai atsparūs cementai, statybiniai skiediniai, betonai ir panašūs mišiniai, įskaitant dolomito mišinį plūkimui, išskyrus produktus, priskiriamus 3801 pozicijai',
    'Mixed alkylbenzenes and mixed alkylnaphthalenes, other than those of heading 2707 or 2902' => 'Sumaišyti alkilbenzenai ir sumaišyti alkilnaftalenai, išskyrus priskiriamus 2707 arba 2902 pozicijai',
    'Chemical elements doped for use in electronics, in the form of discs, wafers or similar forms; chemical compounds doped for use in electronics' => 'Cheminiai elementai su priedais, skirti naudoti elektronikoje, turintys diskų, plokštelių arba panašių formų pavidalą; cheminiai junginiai, su priedais, skirti naudoti elektronikoje',
    'Diagnostic or laboratory reagents on a backing, prepared diagnostic or laboratory reagents whether or not on a backing, whether or not put up in the form of kits, other than those of heading 3006; certified reference materials' => 'Diagnostiniai arba laboratoriniai reagentai su laikmenomis, paruošti diagnostiniai arba laboratoriniai reagentai, su laikmenomis arba be laikmenų, sukomplektuoti arba nesukomplektuoti į rinkinius, išskyrus priskiriamus 3006 pozicijai; sertifikuotos etaloninės medžiagos',
    'Industrial monocarboxylic fatty acids; acid oils from refining; industrial fatty alcohols' => 'Pramoninės riebalų monokarboksirūgštys; rūgščiosios alyvos, gautos rafinuojant; pramoniniai riebalų alkoholiai',
    'Prepared binders for foundry moulds or cores; chemical products and preparations of the chemical or allied industries (including those consisting of mixtures of natural products), not elsewhere specified or included' => 'Paruošti liejimo formų arba gurgučių rišikliai; chemijos pramonės arba giminingų pramonės šakų cheminiai produktai ir preparatai (įskaitant sudarytus iš gamtinių produktų mišinių), nenurodyti kitoje vietoje',
    'Residual products of the chemical or allied industries, not elsewhere specified or included; municipal waste; sewage sludge; other wastes specified in note 6 to this chapter' => 'Chemijos pramonės arba giminingų pramonės šakų liekamieji produktai, nenurodyti kitoje vietoje; buitinės atliekos; nuotekų šlamas; kitos atliekos, nurodytos šio skirsnio 6 pastaboje',
    'Biodiesel and mixtures thereof, not containing or containing less than 70 % by weight of petroleum oils or oils obtained from bituminous minerals' => 'Biodyzelinas ir jo mišiniai, kurių sudėtyje nėra arba yra mažiau kaip 70 % masės naftos alyvų arba alyvų, gautų iš bituminių mineralų',
    'Mixtures containing halogenated derivatives of methane, ethane or propane, not elsewhere specified or included' => 'Mišiniai, kurių sudėtyje yra halogenintų metano, etano ar propano darinių, nenurodyti kitoje vietoje',
    'Polymers of ethylene, in primary forms' => 'Etileno polimerai, pirminės formos',
    'Polymers of propylene or of other olefins, in primary forms' => 'Propileno arba kitų olefinų polimerai, pirminės formos',
    'Polymers of styrene, in primary forms' => 'Stireno polimerai, pirminės formos',
    'Polymers of vinyl chloride or of other halogenated olefins, in primary forms' => 'Vinilchlorido arba kitų halogenintų olefinų polimerai, pirminės formos',
    'Polymers of vinyl acetate or of other vinyl esters, in primary forms; other vinyl polymers in primary forms' => 'Vinilacetato arba kitų vinilo esterių polimerai, pirminės formos; kiti vinilo polimerai, pirminės formos',
    'Acrylic polymers in primary forms' => 'Akrilo polimerai, pirminės formos',
    'Polyacetals, other polyethers and epoxide resins, in primary forms; polycarbonates, alkyd resins, polyallyl esters and other polyesters, in primary forms' => 'Poliacetaliai, kiti polieteriai ir epoksidinės dervos, pirminės formos; polikarbonatai, alkidinės dervos, polialilo esteriai ir kiti poliesteriai, pirminės formos',
    'Polyamides in primary forms' => 'Poliamidai, pirminės formos',
    'Amino-resins, phenolic resins and polyurethanes, in primary forms' => 'Aminodervos, fenolio dervos ir poliuretanai, pirminės formos',
    'Petroleum resins, coumarone-indene resins, polyterpenes, polysulphides, polysulphones and other products specified in note 3 to this chapter, not elsewhere specified or included, in primary forms' => 'Naftos dervos, kumaroninės-indeninės dervos, politerpenai, polisulfidai, polisulfonai ir kiti produktai, nurodyti šio skirsnio 3 pastaboje, nenurodyti kitoje vietoje, pirminės formos',
    'Cellulose and its chemical derivatives, not elsewhere specified or included, in primary forms' => 'Celiuliozė ir jos cheminiai dariniai, nenurodyti kitoje vietoje, pirminės formos',
    'Natural polymers (for example, alginic acid) and modified natural polymers (for example, hardened proteins, chemical derivatives of natural rubber), not elsewhere specified or included, in primary forms' => 'Gamtiniai polimerai (pavyzdžiui, algino rūgštis) ir modifikuoti gamtiniai polimerai (pavyzdžiui, sukietinti baltymai, gamtinio kaučiuko cheminiai dariniai), nenurodyti kitoje vietoje, pirminės formos',
    'Waste, parings and scrap, of plastics' => 'Plastikų atliekos, atraižos ir laužas',
    'Monofilament of which any cross-sectional dimension exceeds 1 mm, rods, sticks and profile shapes, whether or not surface-worked but not otherwise worked, of plastics' => 'Vienagijai siūlai, kurių bet kuris skerspjūvio matmuo didesnis kaip 1 mm, strypai, virbai ir profiliai, apdorotu arba neapdorotu paviršiumi, bet kitu būdu neapdoroti, iš plastikų',
    'Tubes, pipes and hoses, and fittings therefor (for example, joints, elbows, flanges), of plastics' => 'Vamzdžiai, vamzdeliai ir žarnos bei jų jungiamosios detalės (pavyzdžiui, movos, alkūnės, jungės), iš plastikų',
    'Floor coverings of plastics, whether or not self-adhesive, in rolls or in the form of tiles; wall or ceiling coverings of plastics, as defined in note 9 to this chapter' => 'Grindų dangos iš plastikų, lipnios arba nelipnios, susuktos į ritinius arba plokščių pavidalo; sienų arba lubų dangos iš plastikų, apibrėžtos šio skirsnio 9 pastaboje',
    'Self-adhesive plates, sheets, film, foil, tape, strip and other flat shapes, of plastics, whether or not in rolls' => 'Lipnios plokštės, lakštai, plėvelės, folijos, juostelės, juostos ir kitos plokščios formos, iš plastikų, susuktos arba nesusuktos į ritinius',
    'Other plates, sheets, film, foil and strip, of plastics, non-cellular and not reinforced, laminated, supported or similarly combined with other materials' => 'Kitos plokštės, lakštai, plėvelės, folijos ir juostelės, iš plastikų, neakyti ir nearmuoti, nelaminuoti, nesutvirtinti ir panašiai nekombinuoti su kitomis medžiagomis',
    'Other plates, sheets, film, foil and strip, of plastics' => 'Kitos plokštės, lakštai, plėvelės, folijos ir juostelės, iš plastikų',
    'Baths, shower-baths, sinks, washbasins, bidets, lavatory pans, seats and covers, flushing cisterns and similar sanitary ware, of plastics' => 'Vonios, dušai, kriauklės, praustuvės, bidės, unitazai, unitazų sėdynės ir dangteliai, tualeto bakeliai ir panašūs sanitariniai (santechnikos) gaminiai, iš plastikų',
    'Articles for the conveyance or packing of goods, of plastics; stoppers, lids, caps and other closures, of plastics' => 'Gaminiai, skirti prekių transportavimui arba pakavimui, iš plastikų; kamščiai, dangteliai, gaubtukai ir kiti uždarymo reikmenys, iš plastikų',
    'Tableware, kitchenware, other household articles and hygienic or toilet articles, of plastics' => 'Stalo, virtuvės indai, kiti namų apyvokos ir higienos arba tualeto reikmenys, iš plastikų',
    'Builders\' ware of plastics, not elsewhere specified or included' => 'Statybos reikmenys iš plastikų, nenurodyti kitoje vietoje',
    'Other articles of plastics and articles of other materials of headings 3901 to 3914' => 'Kiti gaminiai iš plastikų ir gaminiai iš kitų medžiagų, priskiriamų 3901–3914 pozicijoms',
    'Natural rubber, balata, gutta-percha, guayule, chicle and similar natural gums, in primary forms or in plates, sheets or strip' => 'Gamtinis kaučiukas, balata, gutaperčia, gvajulė, čiklė ir panašios gamtinės dervos, turinčios pirminių formų, plokščių, lakštų arba juostelių pavidalą',
    'Synthetic rubber and factice derived from oils, in primary forms or in plates, sheets or strip; mixtures of any product of heading 4001 with any product of this heading, in primary forms or in plates, sheets or strip' => 'Sintetinis kaučiukas ir faktisas, gautas iš aliejų, turintis pirminių formų arba plokščių, lakštų arba juostelių pavidalą; bet kurių produktų, priskiriamų 4001 pozicijai, mišiniai su bet kuriais šiai pozicijai priskiriamais produktais, turintys pirminių formų arba plokščių, lakštų arba juostelių pavidalą',
    'Compounded rubber, unvulcanised, in primary forms or in plates, sheets or strip' => 'Nevulkanizuotas kaučiukas, į kurį primaišyta kitų medžiagų, turintis pirminių formų arba plokščių, lakštų arba juostelių pavidalą',
    'Other forms (for example, rods, tubes and profile shapes) and articles (for example, discs and rings), of unvulcanised rubber' => 'Kitos formos (pavyzdžiui, strypai, vamzdžiai ir profiliai) bei gaminiai (pavyzdžiui, diskai ir žiedai) iš nevulkanizuoto kaučiuko',
    'Plates, sheets, strip, rods and profile shapes, of vulcanised rubber other than hard rubber' => 'Plokštės, lakštai, juostelės, strypai ir profiliai iš vulkanizuoto kaučiuko (gumos), išskyrus kietą gumą',
    'Tubes, pipes and hoses, of vulcanised rubber other than hard rubber, with or without their fittings (for example, joints, elbows, flanges)' => 'Vamzdžiai, vamzdeliai ir žarnos iš vulkanizuoto kaučiuko (gumos), išskyrus kietą gumą, su jungiamosiomis detalėmis (pavyzdžiui, movomis, alkūnėmis, jungėmis) arba be jungiamųjų detalių',
    'Conveyor or transmission belts or belting, of vulcanised rubber' => 'Konvejerių juostos, pavarų diržai arba jiems gaminti naudojamas beltingas iš vulkanizuoto kaučiuko (gumos)',
    'New pneumatic tyres, of rubber' => 'Naujos pneumatinės guminės padangos',
    'Retreaded or used pneumatic tyres of rubber; solid or cushion tyres, tyre treads and tyre flaps, of rubber' => 'Restauruotos arba naudotos pneumatinės guminės padangos; padangos pilnavidurės (vientisos) arba su izoliuotu oro sluoksniu, padangų protektoriai ir padangų juostos, iš gumos',
    'Inner tubes, of rubber' => 'Guminės kameros',
    'Hygienic or pharmaceutical articles (including teats), of vulcanised rubber other than hard rubber, with or without fittings of hard rubber' => 'Higienos arba farmacijos dirbiniai (įskaitant žindukus) iš vulkanizuoto kaučiuko (gumos), išskyrus kietą gumą, su jungiamosiomis detalėmis iš kietos gumos arba be jungiamųjų detalių',
    'Articles of apparel and clothing accessories (including gloves, mittens and mitts), for all purposes, of vulcanised rubber other than hard rubber' => 'Drabužiai ir drabužių priedai (įskaitant pirštines, kumštines pirštines ir puspirštines), įvairios paskirties, iš vulkanizuoto kaučiuko (gumos), išskyrus kietą gumą',
    'Other articles of vulcanised rubber other than hard rubber' => 'Kiti gaminiai iš vulkanizuoto kaučiuko (gumos), išskyrus kietą gumą',
    'Raw hides and skins of bovine (including buffalo) or equine animals (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split' => 'Žaliavinės galvijų (įskaitant buivolus) arba arklinių šeimos gyvūnų odos (šviežios arba sūdytos, džiovintos, kalkintos, pikeliuotos arba kitu būdu konservuotos, bet neraugintos, neišdirbtos į pergamentą arba toliau neapdorotos), be plaukų arba su plaukais, skeltinės arba neskeltinės',
    'Raw skins of sheep or lambs (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not with wool on or split, other than those excluded by note 1(c) to this chapter' => 'Žaliavinės avių arba ėriukų odos (šviežios arba sūdytos, džiovintos, kalkintos, pikeliuotos arba kitu būdu konservuotos, bet neraugintos, neišdirbtos į pergamentą arba toliau neapdorotos), su vilna arba be vilnos, skeltinės arba neskeltinės, išskyrus nurodytas šio skirsnio 1 pastabos c punkte kaip išimtis',
    'Other raw hides and skins (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split, other than those excluded by note 1(b) or 1(c) to this chapter' => 'Kitos žaliavinės odos (šviežios arba sūdytos, džiovintos, kalkintos, pikeliuotos arba kitu būdu konservuotos, bet neraugintos, neišdirbtos į pergamentą arba toliau neapdorotos), be plaukų arba su plaukais, skeltinės arba neskeltinės, išskyrus nurodytas šio skirsnio 1 pastabos b punkte arba 1 pastabos c punkte kaip išimtis',
    'Tanned or crust hides and skins of bovine (including buffalo) or equine animals, without hair on, whether or not split, but not further prepared' => 'Galvijų (įskaitant buivolus) arba arklinių šeimos gyvūnų odos, raugintos arba krastas, be plaukų, skeltinės arba neskeltinės, bet toliau neapdorotos',
    'Tanned or crust skins of sheep or lambs, without wool on, whether or not split, but not further prepared' => 'Avių arba ėriukų odos, raugintos arba krastas, be vilnos, skeltinės arba neskeltinės, bet toliau neapdorotos',
    'Tanned or crust hides and skins of other animals, without wool or hair on, whether or not split, but not further prepared' => 'Kitų gyvūnų odos, raugintos arba krastas, be vilnos arba plaukų, skeltinės arba neskeltinės, bet toliau neapdorotos',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of bovine (including buffalo) or equine animals, without hair on, whether or not split, other than leather of heading 4114' => 'Išdirbtos galvijų (įskaitant buivolus) arba arklinių šeimos gyvūnų odos, toliau apdorotos po rauginimo arba krasto pagaminimo, įskaitant odas, išdirbtas į pergamentą, be plaukų, skeltinės arba neskeltinės, išskyrus išdirbtas odas, priskiriamas 4114 pozicijai',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of other animals, without wool or hair on, whether or not split, other than leather of heading 4114' => 'Išdirbtos kitų gyvūnų odos, toliau apdorotos po rauginimo arba krasto pagaminimo, įskaitant odas, išdirbtas į pergamentą, be vilnos arba plaukų, skeltinės arba neskeltinės, išskyrus išdirbtas odas, priskiriamas 4114 pozicijai',
    'Chamois (including combination chamois) leather; patent leather and patent laminated leather; metallised leather' => 'Zomša (įskaitant kombinuotą zomšą); lakinės odos ir lakinės laminuotos odos; metalizuotos odos',
    'Composition leather with a basis of leather or leather fibre, in slabs, sheets or strip, whether or not in rolls; parings and other waste of leather or of composition leather, not suitable for the manufacture of leather articles; leather dust, powder and flour' => 'Kompozicinės odos, daugiausia sudarytos iš išdirbtų odų arba iš odos pluoštų, plokščios, lakštinės arba juostinės, suvyniotos į ritinius arba nesuvyniotos; atraižos ir kitos išdirbtų odų arba kompozicinių odų atliekos, netinkamos odos dirbiniams gaminti; odos dulkės, milteliai ir miltai',
    'Trunks, suitcases, vanity cases, executive-cases, briefcases, school satchels, spectacle cases, binocular cases, camera cases, musical instrument cases, gun cases, holsters and similar containers; travelling-bags, insulated food or beverages bags, toilet bags, rucksacks, handbags, shopping-bags, wallets, purses, map-cases, cigarette-cases, tobacco-pouches, tool bags, sports bags, bottle-cases, jewellery boxes, powder boxes, cutlery cases and similar containers, of leather or of composition leather, of sheeting of plastics, of textile materials, of vulcanised fibre or of paperboard, or wholly or mainly covered with such materials or with paper' => 'Skrynios, lagaminai, lagaminėliai (skrynelės kosmetikai), biuro reikmenų dėklai ir krepšiai, portfeliai, mokykliniai krepšiai ir mokyklinės kuprinės, akinių dėklai, žiūronų dėklai, fotoaparatų ir kino kamerų dėklai, muzikos instrumentų dėklai, šautuvų įmautės, pistoletų dėklai ir panašūs daiktai; kelioninės rankinės, izoliuoti krepšiai, skirti maistui arba gėrimams, reikmeninės, kuprinės, rankinės, ūkiniai krepšiai, piniginės, susegamosios piniginės, žemėlapių dėklai, portsigarai, tabakinės, įrankinės, sportiniai krepšiai, butelių dėklai, papuošalų dėžutės, pudrinės, stalo įrankių dėžutės ir panašūs daiktai iš išdirbtos arba kompozicinės odos, lakštinių plastikų, tekstilės medžiagų, vulkanizuotos fibros arba kartono, arba visai arba daugiausia padengti šiomis medžiagomis arba popieriumi',
    'Articles of apparel and clothing accessories, of leather or of composition leather' => 'Drabužiai ir drabužių priedai iš išdirbtos arba kompozicinės odos',
    'Other articles of leather or of composition leather' => 'Kiti dirbiniai iš išdirbtos arba kompozicinės odos',
    'Raw furskins (including heads, tails, paws and other pieces or cuttings, suitable for furriers\' use), other than raw hides and skins of heading 4101, 4102 or 4103' => 'Žaliaviniai kailiai (įskaitant galvenas, uodegenas, kojenas ir kitas dalis arba atraižas, tinkamas naudoti kailininkystei), išskyrus žaliavines odas, priskiriamas 4101, 4102 arba 4103 pozicijai',
    'Tanned or dressed furskins (including heads, tails, paws and other pieces or cuttings), unassembled, or assembled (without the addition of other materials) other than those of heading 4303' => 'Rauginti arba išdirbti kailiai (įskaitant galvenas, uodegenas, kojenas ir kitas dalis arba atraižas), nesujungti arba sujungti (be kitų medžiagų priedų), išskyrus priskiriamus 4303 pozicijai',
    'Articles of apparel, clothing accessories and other articles of furskin' => 'Drabužiai, drabužių priedai ir kiti kailių dirbiniai',
    'Fuel wood, in logs, in billets, in twigs, in faggots or in similar forms; wood in chips or particles; sawdust and wood waste and scrap, whether or not agglomerated in logs, briquettes, pellets or similar forms' => 'Malkinė mediena, turinti rąstgalių, pliauskų, šakų, žabų kūlelių arba panašų pavidalą; medienos skiedros arba smulkiniai; pjuvenos, medienos atliekos ir atraižos, neaglomeruotos arba aglomeruotos ir turinčios rąstgalių, briketų, granulių arba panašų pavidalą',
    'Wood charcoal (including shell or nut charcoal), whether or not agglomerated' => 'Medžio anglys (įskaitant kevalų arba riešutų anglis), aglomeruotos arba neaglomeruotos',
    'Wood in the rough, whether or not stripped of bark or sapwood, or roughly squared' => 'Padarinė mediena, nuo kurios nuskusta arba nenuskusta žievė ar balana arba kuri grubiai aptašyta ar neaptašyta',
    'Hoopwood; split poles; piles, pickets and stakes of wood, pointed but not sawn lengthwise; wooden sticks, roughly trimmed but not turned, bent or otherwise worked, suitable for the manufacture of walking sticks, umbrellas, tool handles or the like; chipwood and the like' => 'Lankinė mediena; perskelti mediniai poliai; medinės kartys, kuolai, stulpeliai ir mietai, nusmailintu galu, bet išilgai neperpjauti; medinės lazdos, grubiai aptašytos, bet nenutekintos, lenktos arba kitais būdais apdorotos, tinkamos naudoti lazdų, skėčių, įrankių rankenoms arba panašiems gaminiams gaminti; plonų juostelių pavidalo ir panaši mediena',
    'Railway or tramway sleepers (cross-ties) of wood' => 'Mediniai geležinkelio arba tramvajaus bėgių pabėgiai',
    'Wood sawn or chipped lengthwise, sliced or peeled, whether or not planed, sanded or end-jointed, of a thickness exceeding 6 mm' => 'Mediena, kurios storis didesnis kaip 6 mm, išilgai perpjauta arba perskelta, drožtinė arba lukštinta, obliuota arba neobliuota, šlifuota arba nešlifuota ar sujungta arba nesujungta galais',
    'Sheets for veneering (including those obtained by slicing laminated wood), for plywood or for similar laminated wood and other wood, sawn lengthwise, sliced or peeled, whether or not planed, sanded, spliced or end-jointed, of a thickness not exceeding 6 mm' => 'Lakštinė faneruotė (įskaitant gautą drožiant sluoksniuotąją medieną), skirta fanerai arba panašiai sluoksniuotajai medienai gaminti, ir kita mediena, kurios storis ne didesnis kaip 6 mm, išilgai perpjauta, drožtinė arba lukštinta, obliuota arba neobliuota, šlifuota arba nešlifuota, sudurta arba nesudurta ar sujungta arba nesujungta galais',
    'Wood (including strips and friezes for parquet flooring, not assembled) continuously shaped (tongued, grooved, rebated, chamfered, V-jointed, beaded, moulded, rounded or the like) along any of its edges, ends or faces, whether or not planed, sanded or end-jointed' => 'Mediena (įskaitant palaidas lenteles ir frizus (apvadus), skirtus parketui), ištisai profiliuota (su įlaidais, išdrožomis, užkaitais, nuosklembomis, V formos sąlaidomis, briaunelėmis, formuota, suapvalinta arba panašiai profiliuota) išilgai bet kurios briaunos, galo arba paviršiaus, obliuota arba neobliuota, šlifuota arba nešlifuota ar sujungta arba nesujungta galais',
    'Particle board, oriented strand board (OSB) and similar board (for example, waferboard) of wood or other ligneous materials, whether or not agglomerated with resins or other organic binding substances' => 'Drožlių plokštės, orientuotosios skiedrantų plokštės (OSB) ir panašios plokštės (pavyzdžiui, plostekių plokštės) iš medienos arba iš kitų panašių į medieną medžiagų, aglomeruotos arba neaglomeruotos dervomis arba kitais organiniais rišikliais',
    'Fibreboard of wood or other ligneous materials, whether or not bonded with resins or other organic substances' => 'Plaušo plokštės iš medienos arba iš kitų panašių į medieną medžiagų, surištos arba nesurištos dervomis arba kitomis organinėmis medžiagomis',
    'Plywood, veneered panels and similar laminated wood' => 'Fanera, faneruoti skydai ir panaši sluoksniuotoji mediena',
    'Wooden frames for paintings, photographs, mirrors or similar objects' => 'Mediniai paveikslų, fotografijų, veidrodžių ir panašių daiktų rėmai',
    'Packing cases, boxes, crates, drums and similar packings, of wood; cable-drums of wood; pallets, box pallets and other load boards, of wood; pallet collars of wood' => 'Medinės dėžės, dėžutės, grotelinės dėžės, būgnai ir panaši tara; mediniai kabelių būgnai; padėklai, dėžiniai padėklai ir kiti mediniai krovimo skydai; mediniai padėklų apvadai',
    'Builders\' joinery and carpentry of wood, including cellular wood panels, assembled flooring panels, shingles and shakes' => 'Statybiniai stalių ir dailidžių gaminiai iš medienos, įskaitant tuščiavidurius skydus, sumontuotus grindų skydus, malksnas ir skalas',
    'Tableware and kitchenware, of wood' => 'Mediniai stalo ir virtuvės reikmenys',
    'Wood marquetry and inlaid wood; caskets and cases for jewellery or cutlery, and similar articles, of wood; statuettes and other ornaments, of wood; wooden articles of furniture not falling in Chapter 94' => 'Medienos marketri ir medienos inkrustacijos; medinės skrynutės ir papuošalų arba stalo įrankių dėžutės ir panašūs dirbiniai iš medienos; statulėlės ir kiti dekoratyviniai dirbiniai iš medienos; mediniai baldų reikmenys, nepriskiriami 94 skirsniui',
    'Other articles of wood' => 'Kiti medienos gaminiai',
    'Natural cork, raw or simply prepared; waste cork; crushed, granulated or ground cork' => 'Gamtinė kamštiena, žaliavinė arba paprastai paruošta; kamštienos atliekos; trupinta, granuliuota arba malta kamštiena',
    'Articles of natural cork' => 'Gamtinės kamštienos dirbiniai',
    'Agglomerated cork (with or without a binding substance) and articles of agglomerated cork' => 'Aglomeruota kamštiena (su rišikliu arba be jo) ir aglomeruotos kamštienos dirbiniai',
    'Plaits and similar products of plaiting materials, whether or not assembled into strips; plaiting materials, plaits and similar products of plaiting materials, bound together in parallel strands or woven, in sheet form, whether or not being finished articles (for example, mats, matting, screens)' => 'Pynės ir panašūs dirbiniai iš pynimo medžiagų, surišti arba nesurišti į juosteles; pynimo medžiagos, pynės ir panašūs pinti dirbiniai iš tarpusavyje surištų lygiagrečių sruogų arba austi dirbiniai iš šių medžiagų, turintys lakštų pavidalą, kurie yra arba nėra gatavi dirbiniai (pavyzdžiui, plaušinės, dembliai, medžiaga plaušinėms arba dembliams gaminti, širmos)',
    'Basketwork, wickerwork and other articles, made directly to shape from plaiting materials or made up from goods of heading 4601; articles of loofah' => 'Pintinės, pinti dirbiniai ir kiti dirbiniai, tiesiogiai suformuoti iš pynimo medžiagų arba iš prekių, priskiriamų 4601 pozicijai; dirbiniai iš šiūruoklių',
    'Mechanical wood pulp' => 'Mechaninė medienos plaušiena',
    'Chemical wood pulp, soda or sulphate, other than dissolving grades' => 'Cheminė medienos plaušiena, natroninė arba sulfatinė, išskyrus tirpiąsias rūšis',
    'Chemical wood pulp, sulphite, other than dissolving grades' => 'Cheminė medienos plaušiena, sulfitinė, išskyrus tirpiąsias rūšis',
    'Pulps of fibres derived from recovered (waste and scrap) paper or paperboard or of other fibrous cellulosic material' => 'Pluoštinė plaušiena, gauta iš perdirbti skirto popieriaus arba kartono (atliekų ir liekanų) arba iš kitų pluoštinių celiuliozinių medžiagų',
    'Recovered (waste and scrap) paper or paperboard' => 'Perdirbti skirtas popierius arba kartonas (atliekos ir liekanos)',
    'Uncoated paper and paperboard, of a kind used for writing, printing or other graphic purposes, and non-perforated punchcards and punch-tape paper, in rolls or rectangular (including square) sheets, of any size, other than paper of heading 4801 or 4803; handmade paper and paperboard' => 'Nepadengtas popierius ir kartonas, naudojami rašyti, spausdinti ir kitiems grafinio atvaizdavimo tikslams, neperforuotas perforuotųjų kortų ir perforuotųjų juostų ritininis arba stačiakampiais (įskaitant kvadratinius) lakštais popierius, išskyrus popierių, priskiriamą 4801 arba 4803 pozicijai; rankų darbo popierius ir kartonas',
    'Toilet or facial tissue stock, towel or napkin stock and similar paper of a kind used for household or sanitary purposes, cellulose wadding and webs of cellulose fibres, whether or not creped, crinkled, embossed, perforated, surface-coloured, surface-decorated or printed, in rolls or sheets' => 'Žaliavinis popierius, naudojamas tualetiniam popieriui, veido servetėlėms, rankšluosčiams arba vystyklams gaminti ir panašus popierius, naudojamas buitinėms arba higieninėms reikmėms, celiuliozinė vata ir celiuliozės pluoštų klodai, krepinis arba nekrepinis, klostytas arba neklostytas, įspaustinis arba neįspaustinis, perforuotas arba neperforuotas, dažytu arba nedažytu, dekoruotu arba nedekoruotu paviršiumi, su atspaudais arba be atspaudų, ritininis arba lakštinis',
    'Uncoated kraft paper and paperboard, in rolls or sheets, other than that of heading 4802 or 4803' => 'Nepadengtas ritininis arba lakštinis kraftpopieris ir kartonas, išskyrus priskiriamus 4802 arba 4803 pozicijai',
    'Other uncoated paper and paperboard, in rolls or sheets, not further worked or processed than as specified in note 3 to this chapter' => 'Kitas nepadengtas ritininis arba lakštinis popierius ir kartonas, toliau neapdorotas ir neperdirbtas, išskyrus šio skirsnio 3 pastaboje nurodytus būdus',
    'Vegetable parchment, greaseproof papers, tracing papers and glassine and other glazed transparent or translucent papers, in rolls or sheets' => 'Augalinis pergaminas, riebalams nelaidus popierius, kalkės, blizgusis pergamentinis popierius ir kitas blizgusis, skaidrus arba pusiau permatomas ritininis arba lakštinis popierius',
    'Composite paper and paperboard (made by sticking flat layers of paper or paperboard together with an adhesive), not surface-coated or impregnated, whether or not internally reinforced, in rolls or sheets' => 'Kombinuotas ritininis arba lakštinis popierius ir kartonas (pagamintas adhezyvu suklijuojant plokščius popieriaus arba kartono sluoksnius), nepadengtu paviršiumi arba neįmirkytas, viduje sutvirtintas arba nesutvirtintas',
    'Paper and paperboard, corrugated (with or without glued flat surface sheets), creped, crinkled, embossed or perforated, in rolls or sheets, other than paper of the kind described in heading 4803' => 'Gofruotas ritininis arba lakštinis popierius ir kartonas (su priklijuotais plokščiais paviršiniais lakštais arba be jų), krepiniai, klostyti, įspaustiniai arba perforuoti, išskyrus popieriaus rūšis, aprašytas 4803 pozicijoje',
    'Carbon paper, self-copy paper and other copying or transfer papers (including coated or impregnated paper for duplicator stencils or offset plates), whether or not printed, in rolls or sheets' => 'Anglinis popierius (kalkė), savaiminio kopijavimo popierius ir kitas kopijavimo arba atspaudimo ritininis arba lakštinis popierius (įskaitant padengtą arba įmirkytą popierių, naudojamą kopijavimo aparatų matricoms arba ofsetinėms plokštėms), su atspaudais arba be atspaudų',
    'Paper and paperboard, coated on one or both sides with kaolin (China clay) or other inorganic substances, with or without a binder, and with no other coating, whether or not surface-coloured, surface-decorated or printed, in rolls or rectangular (including square) sheets, of any size' => 'Popierius ir kartonas, iš vienos arba abiejų pusių padengtas kaolinu ar kitomis neorganinėmis medžiagomis, su rišikliais arba be jų, nepadengti jokiais kitais apvalkalais, dažytu ar nedažytu, dekoruotu ar nedekoruotu paviršiumi, su atspaudais arba be atspaudų, bet kokio dydžio ritiniais arba stačiakampiais (įskaitant kvadratinius) lakštais',
    'Paper, paperboard, cellulose wadding and webs of cellulose fibres, coated, impregnated, covered, surface-coloured, surface-decorated or printed, in rolls or rectangular (including square) sheets, of any size, other than goods of the kind described in heading 4803, 4809 or 4810' => 'Popierius, kartonas, celiuliozinė vata ir celiuliozės pluoštų klodai, įmirkyti, padengti, dažytu paviršiumi, dekoruotu paviršiumi arba su atspaudais, bet kokio dydžio ritiniais arba stačiakampiais (įskaitant kvadratinius), išskyrus prekes, aprašytas 4803, 4809 arba 4810 pozicijoje',
    'Cigarette paper, whether or not cut to size or in the form of booklets or tubes' => 'Rūkomasis popierius, supjaustytas arba nesupjaustytas pagal nustatytus matmenis, taip pat knygelių arba tūtelių pavidalo',
    'Wallpaper and similar wallcoverings; window transparencies of paper' => 'Popieriniai apmušalai ir panašios sienų dangos; permatomos popierinės langų dangos',
    'Carbon paper, self-copy paper and other copying or transfer papers (other than those of heading 4809), duplicator stencils and offset plates, of paper, whether or not put up in boxes' => 'Anglinis popierius (kalkė), savaiminio kopijavimo popierius ir kitas kopijavimo arba atspaudimo popierius (išskyrus priskiriamus 4809 pozicijai), popierinės kopijavimo aparatų matricos ir popierinės ofsetinės plokštės, supakuoti arba nesupakuoti dėžėse',
    'Envelopes, letter cards, plain postcards and correspondence cards, of paper or paperboard; boxes, pouches, wallets and writing compendiums, of paper or paperboard, containing an assortment of paper stationery' => 'Vokai, kortelės laiškams, paprastieji atvirlaiškiai ir susirašinėjimo kortelės iš popieriaus arba kartono; dėžutės, maišeliai, aplankai ir rašymo rinkiniai iš popieriaus arba kartono su popieriniais raštinės reikmenimis',
    'Toilet paper and similar paper, cellulose wadding or webs of cellulose fibres, of a kind used for household or sanitary purposes, in rolls of a width not exceeding 36 cm, or cut to size or shape; handkerchiefs, cleansing tissues, towels, tablecloths, serviettes, bedsheets and similar household, sanitary or hospital articles, articles of apparel and clothing accessories, of paper pulp, paper, cellulose wadding or webs of cellulose fibres' => 'Tualetinis popierius ir panašus popierius, celiuliozinė vata arba celiuliozės pluoštų klodai, naudojami buityje arba sanitarijos tikslams, susukti į ritinėlius, kurių plotis ne didesnis kaip 36 cm, arba supjaustyti pagal nustatytus matmenis arba formą; nosinės, higieninės servetėlės, rankšluosčiai, staltiesės, stalo servetėlės, paklodės ir panašūs buitiniai, higieniniai arba ligoninėse naudojami dirbiniai, drabužiai ir drabužių priedai iš popieriaus plaušienos, popieriaus, celiuliozinės vatos arba celiuliozinių pluoštų klodų',
    'Cartons, boxes, cases, bags and other packing containers, of paper, paperboard, cellulose wadding or webs of cellulose fibres; box files, letter trays, and similar articles, of paper or paperboard, of a kind used in offices, shops or the like' => 'Dėžės, dėžutės, dėklai, krepšiai ir kitos pakavimo talpyklos iš popieriaus, kartono, celiuliozinės vatos arba celiuliozinių pluoštų klodų; dokumentų dėžės, laiškų dėtuvai ir panašūs dirbiniai iš popieriaus arba kartono, naudojami įstaigose, parduotuvėse arba turintys panašią paskirtį',
    'Registers, account books, notebooks, order books, receipt books, letter pads, memorandum pads, diaries and similar articles, exercise books, blotting pads, binders (loose-leaf or other), folders, file covers, manifold business forms, interleaved carbon sets and other articles of stationery, of paper or paperboard; albums for samples or for collections and book covers, of paper or paperboard' => 'Registravimo žurnalai, apskaitos knygos, užrašų knygelės, užsakymų knygos, kvitų knygelės, laiškinio popieriaus bloknotai, užrašų bloknotai, dienoraščiai ir panašūs dirbiniai, sąsiuviniai, biuvarai, segtuvai (su nuplėšiamais lapais arba kiti), aplankai, bylų viršeliai, įstaigų blankai su kopijų blankais, knygelės su įdėtomis kopijavimo kalkėmis ir kiti raštinės reikmenys iš popieriaus arba kartono; pavyzdžių arba kolekcijų albumai ir knygų viršeliai iš popieriaus arba kartono',
    'Paper or paperboard labels of all kinds, whether or not printed' => 'Visų rūšių etiketės iš popieriaus arba kartono, su atspaudais arba be atspaudų',
