    'Cullet and other waste and scrap of glass, excluding glass from cathode-ray tubes or other activated glass of heading 8549; glass in the mass' => 'Stiklo duženos ir kitos stiklo atliekos bei laužas, išskyrus elektroninių vamzdžių stiklą arba kitą aktyvintą stiklą, priskiriamą 8549 pozicijai; stiklo masė',
    'Glass in balls (other than microspheres of heading 7018), rods or tubes, unworked' => 'Neapdorotas stiklas, turintis rutulių (išskyrus mikrosferas, priskiriamas 7018 pozicijai), strypų arba vamzdžių pavidalą',
    'Cast glass and rolled glass, in sheets or profiles, whether or not having an absorbent, reflecting or non-reflecting layer, but not otherwise worked' => 'Lietinis stiklas ir valcuotasis stiklas, turintys lakštų arba profilių pavidalą, padengti absorbciniu, atspindinčiu arba neatspindinčiu sluoksniu ar be tokio sluoksnio, bet kitu būdu neapdorotas',
    'Drawn glass and blown glass, in sheets, whether or not having an absorbent, reflecting or non-reflecting layer, but not otherwise worked' => 'Temptasis stiklas ir pūstinis stiklas, turintys lakštų pavidalą, padengti absorbciniu, atspindinčiu arba neatspindinčiu sluoksniu ar be tokio sluoksnio, bet kitu būdu neapdoroti',
    'Float glass and surface ground or polished glass, in sheets, whether or not having an absorbent, reflecting or non-reflecting layer, but not otherwise worked' => 'Flotacinis stiklas (float glass) ir stiklas šlifuotu arba poliruotu paviršiumi, turintys lakštų pavidalą, padengti absorbciniu, atspindinčiu arba neatspindinčiu sluoksniu ar be tokio sluoksnio, bet kitu būdu neapdoroti',
    'Glass of heading 7003, 7004 or 7005, bent, edge-worked, engraved, drilled, enamelled or otherwise worked, but not framed or fitted with other materials' => 'Stiklas, priskiriamas 7003, 7004 arba 7005 pozicijai, išlenktas, apdorotomis briaunomis, graviruotas, pragręžtas, emaliuotas arba kitu būdu apdorotas, bet neįrėmintas ir neaptaisytas kitomis medžiagomis',
    'Safety glass, consisting of toughened (tempered) or laminated glass' => 'Beskeveldris stiklas, sudarytas iš grūdintojo (temperuotojo) arba sluoksniuotojo stiklo',
    'Multiple-walled insulating units of glass' => 'Daugiasieniai izoliacijos elementai iš stiklo',
    'Glass mirrors, whether or not framed, including rear-view mirrors' => 'Stikliniai veidrodžiai, įrėminti arba neįrėminti, įskaitant galinio vaizdo veidrodžius',
    'Carboys, bottles, flasks, jars, pots, phials, ampoules and other containers, of glass, of a kind used for the conveyance or packing of goods; preserving jars of glass; stoppers, lids and other closures, of glass' => 'Didbuteliai, buteliai, flakonai, stiklainiai, ąsoti indai, buteliukai, ampulės ir kitos stiklinės talpyklos, naudojamos prekėms gabenti arba pakuoti; konservavimo stiklainiai; stikliniai kamščiai, dangteliai ir kiti uždarymo reikmenys',
    'Glass envelopes (including bulbs and tubes), open, and glass parts thereof, without fittings, for electric lamps and light sources, cathode-ray tubes or the like' => 'Atviri stikliniai gaubtai (įskaitant kolbas ir vamzdelius) bei jų stiklinės dalys, be jungiamųjų detalių, skirti elektros lempoms ir šviesos šaltiniams, elektroniniams vamzdeliams ir panašiems dirbiniams',
    'Glassware of a kind used for table, kitchen, toilet, office, indoor decoration or similar purposes (other than that of heading 7010 or 7018)' => 'Stiklo dirbiniai, naudojami stalui serviruoti, virtuvėje, tualetui, biure, interjerams dekoruoti arba turintys panašią paskirtį (išskyrus dirbinius, priskiriamus 7010 arba 7018 pozicijai)',
    'Clock or watch glasses and similar glasses, glasses for non-corrective or corrective spectacles, curved, bent, hollowed or the like, not optically worked; hollow glass spheres and their segments, for the manufacture of such glasses' => 'Laikrodžių stiklai ir panašūs stiklai, nekorekcinių arba korekcinių akinių stiklai, išlenkti, gaubti, tuščiaviduriai arba panašūs stiklai, optiškai neapdoroti; tuščiavidurės stiklinės sferos ir jų segmentai, naudojami tokiems stiklams gaminti',
