    'Laboratory, hygienic or pharmaceutical glassware, whether or not graduated or calibrated' => 'Stiklo dirbiniai, skirti laboratorijoms, higienos arba farmacijos reikmėms, graduoti arba negraduoti, kalibruoti arba nekalibruoti',
    'Glass beads, imitation pearls, imitation precious or semi-precious stones and similar glass smallwares, and articles thereof other than imitation jewellery; glass eyes other than prosthetic articles; statuettes and other ornaments of lamp-worked glass, other than imitation jewellery; glass microspheres not exceeding 1 mm in diameter' => 'Stikliniai karoliukai, perlų imitacijos, brangakmenių arba pusbrangių akmenų imitacijos ir panašūs smulkūs stiklo dirbiniai bei iš jų pagamintos prekės, išskyrus dirbtinę bižuteriją; stiklinės akys, išskyrus protezus; statulėlės ir kiti dekoratyviniai dirbiniai iš degikliu apdoroto stiklo, išskyrus dirbtinę bižuteriją; stiklinės mikrosferos, kurių skersmuo ne didesnis kaip 1 mm',
    'Glass fibres (including glass wool) and articles thereof (for example, yarn, rovings, woven fabrics)' => 'Stiklo pluoštai (įskaitant stiklo vatą) ir jų dirbiniai (pavyzdžiui, verpalai, pusverpaliai, audiniai)',
    'Other articles of glass' => 'Kiti stiklo dirbiniai',
    'Pearls, natural or cultured, whether or not worked or graded but not strung, mounted or set; pearls, natural or cultured, temporarily strung for convenience of transport' => 'Gamtiniai arba dirbtiniu būdu išauginti perlai, apdoroti arba neapdoroti, surūšiuoti arba nesurūšiuoti, tačiau nesuverti, neaptaisyti ir neįtvirtinti; gamtiniai arba dirbtiniu būdu išauginti perlai, laikinai suverti gabenimo patogumui',
    'Diamonds, whether or not worked, but not mounted or set' => 'Deimantai, apdoroti arba neapdoroti, tačiau neaptaisyti arba neįtvirtinti',
    'Precious stones (other than diamonds) and semi-precious stones, whether or not worked or graded but not strung, mounted or set; ungraded precious stones (other than diamonds) and semi-precious stones, temporarily strung for convenience of transport' => 'Brangakmeniai (išskyrus deimantus) ir pusbrangiai akmenys, apdoroti arba neapdoroti, surūšiuoti arba nesurūšiuoti, tačiau nesuverti, neaptaisyti arba neįtvirtinti; nesurūšiuoti brangakmeniai (išskyrus deimantus) ir pusbrangiai akmenys, laikinai suverti gabenimo patogumui',
    'Synthetic or reconstructed precious or semi-precious stones, whether or not worked or graded but not strung, mounted or set; ungraded synthetic or reconstructed precious or semi-precious stones, temporarily strung for convenience of transport' => 'Sintetiniai arba regeneruoti brangakmeniai arba pusbrangiai akmenys, apdoroti arba neapdoroti, surūšiuoti arba nesurūšiuoti, tačiau nesuverti, neaptaisyti arba neįtvirtinti; nesurūšiuoti sintetiniai arba regeneruoti brangakmeniai arba pusbrangiai akmenys, laikinai suverti gabenimo patogumui',
    'Dust and powder of natural or synthetic precious or semi-precious stones' => 'Gamtinių arba sintetinių brangakmenių arba pusbrangių akmenų dulkės arba milteliai',
    'Silver (including silver plated with gold or platinum), unwrought or in semi-manufactured forms, or in powder form' => 'Sidabras (įskaitant sidabrą, padengtą auksu arba platina), neapdorotas, pusiau apdorotas arba turintis miltelių pavidalą',
    'Gold (including gold plated with platinum), unwrought or in semi-manufactured forms, or in powder form' => 'Auksas (įskaitant auksą, padengtą platina), neapdorotas, pusiau apdorotas arba turintis miltelių pavidalą',
    'Platinum, unwrought or in semi-manufactured forms, or in powder form' => 'Platina, neapdorota, pusiau apdorota arba turinti miltelių pavidalą',
