    'Articles of jewellery and parts thereof, of precious metal or of metal clad with precious metal' => 'Bižuterija ir jos dalys iš tauriojo metalo arba iš metalo, plakiruoto tauriuoju metalu',
    'Articles of goldsmiths\' or silversmiths\' wares and parts thereof, of precious metal or of metal clad with precious metal' => 'Aukso arba sidabro dailieji dirbiniai ir jų dalys iš tauriojo metalo arba iš metalo, plakiruoto tauriuoju metalu',
    'Other articles of precious metal or of metal clad with precious metal' => 'Kiti dirbiniai iš tauriojo metalo arba iš metalo, plakiruoto tauriuoju metalu',
    'Articles of natural or cultured pearls, precious or semi-precious stones (natural, synthetic or reconstructed)' => 'Dirbiniai iš gamtinių arba iš dirbtiniu būdu išaugintų perlų, brangakmenių arba pusbrangių akmenų (gamtinių, sintetinių arba regeneruotų)',
    'Imitation jewellery' => 'Dirbtinė bižuterija',
    'Coin' => 'Monetos',
