    'Ferrous waste and scrap; remelting scrap ingots of iron or steel' => 'Juodųjų metalų atliekos ir laužas; geležies arba plieno laužo liejiniai, perlydyti',
    'Granules and powders, of pig iron, spiegeleisen, iron or steel' => 'Ketaus, veidrodinio ketaus (spiegeleisen), geležies arba plieno granulės ir milteliai',
    'Iron and non-alloy steel in ingots or other primary forms (excluding iron of heading 7203)' => 'Geležis ir nelegiruotasis plienas, turintys luitų arba kitų pirminių formų pavidalą (išskyrus geležį, priskiriamą 7203 pozicijai)',
    'Semi-finished products of iron or non-alloy steel' => 'Geležies arba nelegiruotojo plieno pusgaminiai',
