    'Flat-rolled products of iron or non-alloy steel, of a width of less than 600 mm, clad, plated or coated' => 'Plokšti valcavimo produktai iš geležies arba iš nelegiruotojo plieno, kurių plotis mažesnis kaip 600 mm, plakiruoti, padengti arba apvilkti',
    'Bars and rods, hot-rolled, in irregularly wound coils, of iron or non-alloy steel' => 'Karštai valcuoti strypai ir juostos iš geležies arba iš nelegiruotojo plieno, netaisyklingai suvyniotų ritinių pavidalo',
    'Other bars and rods of iron or non-alloy steel, not further worked than forged, hot-rolled, hot-drawn or hot-extruded, but including those twisted after rolling' => 'Kiti strypai ir juostos iš geležies arba iš nelegiruotojo plieno, po kalimo, karštojo valcavimo, karštojo tempimo arba karštojo išspaudimo (ekstruzijos) toliau neapdoroti, įskaitant po valcavimo susuktus arba supintus',
    'Other bars and rods of iron or non-alloy steel' => 'Kiti strypai ir juostos iš geležies arba iš nelegiruotojo plieno',
    'Angles, shapes and sections of iron or non-alloy steel' => 'Kampuočiai, fasoniniai profiliai ir specialieji profiliai iš geležies arba iš nelegiruotojo plieno',
    'Wire of iron or non-alloy steel' => 'Viela iš geležies arba iš nelegiruotojo plieno',
    'Stainless steel in ingots or other primary forms; semi-finished products of stainless steel' => 'Nerūdijantysis plienas, turintis luitų arba kitų pirminių formų pavidalą; nerūdijančiojo plieno pusgaminiai',
    'Flat-rolled products of stainless steel, of a width of 600 mm or more' => 'Plokšti valcavimo produktai iš nerūdijančiojo plieno, kurių plotis ne mažesnis kaip 600 mm',
    'Flat-rolled products of stainless steel, of a width of less than 600 mm' => 'Plokšti valcavimo produktai iš nerūdijančiojo plieno, kurių plotis mažesnis kaip 600 mm',
    'Other bars and rods of stainless steel; angles, shapes and sections of stainless steel' => 'Kiti strypai ir juostos iš nerūdijančiojo plieno; kampuočiai, fasoniniai profiliai ir specialieji profiliai iš nerūdijančiojo plieno',
    'Other alloy steel in ingots or other primary forms; semi-finished products of other alloy steel' => 'Kitas legiruotasis plienas, turintis luitų arba kitų pirminių formų pavidalą; kito legiruotojo plieno pusgaminiai',
    'Flat-rolled products of other alloy steel, of a width of 600 mm or more' => 'Plokšti valcavimo produktai iš kito legiruotojo plieno, kurių plotis ne mažesnis kaip 600 mm',
    'Flat-rolled products of other alloy steel, of a width of less than 600 mm' => 'Plokšti valcavimo produktai iš kito legiruotojo plieno, kurių plotis mažesnis kaip 600 mm',
    'Bars and rods, hot-rolled, in irregularly wound coils, of other alloy steel' => 'Karštai valcuoti strypai ir juostos iš kito legiruotojo plieno, netaisyklingai suvyniotų ritinių pavidalo',
    'Other bars and rods of other alloy steel; angles, shapes and sections, of other alloy steel; hollow drill bars and rods, of alloy or non-alloy steel' => 'Kiti strypai ir juostos iš kito legiruotojo plieno; kampuočiai, fasoniniai profiliai ir specialieji profiliai iš kito legiruotojo plieno; tuščiaviduriai gręžimo strypai ir juostos iš legiruotojo arba iš nelegiruotojo plieno',
    'Wire of other alloy steel' => 'Viela iš kito legiruotojo plieno',
    'Sheet piling of iron or steel, whether or not drilled, punched or made from assembled elements; welded angles, shapes and sections, of iron or steel' => 'Lakštinės atraminės konstrukcijos iš geležies arba iš plieno, išgręžiotos arba neišgręžiotos, perforuotos arba neperforuotos, monolitinės arba surinktos iš elementų; suvirinti kampuočiai, fasoniniai profiliai ir specialieji profiliai, iš geležies arba iš plieno',
    'Railway or tramway track construction material of iron or steel, the following' => 'rails, check-rails and rack rails, switch blades, crossing frogs, point rods and other crossing pieces, sleepers (cross-ties), fish-plates, chairs, chair wedges, sole plates (base plates), rail clips, bedplates, ties and other material specialised for jointing or fixing rails\': \'Geležinkelių ir tramvajų kelių konstrukcijų sudedamosios dalys iš geležies arba iš plieno: bėgiai, gretbėgiai ir krumpliniai bėgiai, iešmų plunksnos, aklinių sankirtų kryžmės, iešmų smailės ir kitos kryžmės, pabėgiai (kryžminiai žuoliai), sandūrinės tvarslės, bėgių guoliai, bėgių guolių pleištai, atraminės plokštės, pamatinės plokštės, bėgių sąvaržos, padėklinės plokštės, žuoliai ir kitos bėgių sujungimo arba tvirtinimo detalės',
    'Tubes, pipes and hollow profiles, of cast iron' => 'Vamzdžiai, vamzdeliai ir tuščiaviduriai profiliai iš ketaus',
    'Tubes, pipes and hollow profiles, seamless, of iron (other than cast iron) or steel' => 'Besiūliai vamzdžiai, vamzdeliai ir tuščiaviduriai profiliai iš geležies (išskyrus ketų) arba iš plieno',
    'Other tubes and pipes (for example, welded, riveted or similarly closed), having circular cross-sections, the external diameter of which exceeds 406,4 mm, of iron or steel' => 'Kiti vamzdžiai ir vamzdeliai (pavyzdžiui, suvirinti, sukniedyti arba sujungti panašiu būdu), apskrito vidinio ir išorinio skerspjūvio, kurių išorinis skersmuo didesnis kaip 406,4 mm, iš geležies arba iš plieno',
    'Other tubes, pipes and hollow profiles (for example, open seam or welded, riveted or similarly closed), of iron or steel' => 'Kiti vamzdžiai, vamzdeliai ir tuščiaviduriai profiliai (pavyzdžiui, atvirasiūliai arba suvirinti, sukniedyti arba sujungti panašiu būdu), iš geležies arba iš plieno',
    'Tube or pipe fittings (for example, couplings, elbows, sleeves), of iron or steel' => 'Vamzdžių arba vamzdelių jungiamosios detalės (pavyzdžiui, alkūnės, movos) iš geležies arba plieno',
    'Structures (excluding prefabricated buildings of heading 9406) and parts of structures (for example, bridges and bridge-sections, lock-gates, towers, lattice masts, roofs, roofing frameworks, doors and windows and their frames and thresholds for doors, shutters, balustrades, pillars and columns), of iron or steel; plates, rods, angles, shapes, sections, tubes and the like, prepared for use in structures, of iron or steel' => 'Metalinės konstrukcijos (išskyrus surenkamuosius statinius, priskiriamus 9406 pozicijai) ir metalinės konstrukcijų dalys (pavyzdžiui, tiltai ir tiltų sekcijos, šliuzų vartai, bokštai, ažūriniai stiebai, stogai, stogų konstrukcijų karkasai, durys ir langai bei jų rėmai, durų slenksčiai, langinės, baliustrados, atramos ir kolonos) iš geležies arba plieno; plokštės, strypai, kampuočiai, fasoniniai profiliai, specialieji profiliai, vamzdžiai ir panašūs gaminiai, paruošti naudoti statybinėse konstrukcijose, iš geležies arba plieno',
    'Reservoirs, tanks, vats and similar containers for any material (other than compressed or liquefied gas), of iron or steel, of a capacity exceeding 300 l, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Rezervuarai, cisternos, bakai ir panašios bet kurių medžiagų (išskyrus suslėgtas ir suskystintas dujas) talpyklos iš geležies arba plieno, kurių talpa didesnė kaip 300 litrų, aptaisytos arba neaptaisytos, su termoizoliacija arba be termoizoliacijos, tačiau be pritvirtintos mechaninės arba šiluminės įrangos',
    'Tanks, casks, drums, cans, boxes and similar containers, for any material (other than compressed or liquefied gas), of iron or steel, of a capacity not exceeding 300 l, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Cisternos, statinės, būgnai, skardinės, dėžės ir panašios bet kurių medžiagų (išskyrus suslėgtas ir suskystintas dujas) talpyklos iš geležies arba plieno, kurių talpa ne didesnė kaip 300 litrų, aptaisytos arba neaptaisytos, su termoizoliacija arba be termoizoliacijos, tačiau be pritvirtintos mechaninės arba šiluminės įrangos',
    'Containers for compressed or liquefied gas, of iron or steel' => 'Suslėgtų arba suskystintų dujų talpyklos iš geležies arba iš plieno',
    'Stranded wire, ropes, cables, plaited bands, slings and the like, of iron or steel, not electrically insulated' => 'Suvyta viela, lynai, kabeliai, pintos juostos, stropai ir panašūs gaminiai iš geležies arba plieno be elektros izoliacijos',
    'Cloth (including endless bands), grill, netting and fencing, of iron or steel wire; expanded metal of iron or steel' => 'Audiniai (įskaitant transporterių juostas), grotelės, tinklai ir aptvarai iš geležinės arba plieninės vielos; prakirtinėti išplėstiniai metalo lakštai iš geležies arba plieno',
    'Chain and parts thereof, of iron or steel' => 'Grandinės ir jų dalys iš geležies arba plieno',
    'Nails, tacks, drawing pins, corrugated nails, staples (other than those of heading 8305) and similar articles, of iron or steel, whether or not with heads of other material, but excluding such articles with heads of copper' => 'Vinys, vinutės su plačiomis galvutėmis, braižybos smeigtukai, briaunotos vinys, sankabos (išskyrus priskiriamas 8305 pozicijai) ir panašūs gaminiai iš geležies arba plieno, su galvutėmis iš kitų medžiagų arba be tokių galvučių, tačiau išskyrus tokios rūšies gaminius su varinėmis galvutėmis',
    'Screws, bolts, nuts, coach screws, screw hooks, rivets, cotters, cotter pins, washers (including spring washers) and similar articles, of iron or steel' => 'Sraigtai, varžtai, veržlės, medsraigčiai, įsukami kabliai, kniedės, sprausteliai, vielokaiščiai, poveržlės (įskaitant spyruoklines poveržles) ir panašūs gaminiai iš geležies arba plieno',
