    'Springs and leaves for springs, of iron or steel' => 'Spyruoklės ir lingių plokštės iš geležies arba plieno',
    'Stoves, ranges, grates, cookers (including those with subsidiary boilers for central heating), barbecues, braziers, gas rings, plate warmers and similar non-electric domestic appliances, and parts thereof, of iron or steel' => 'Krosnys, krosnys-viryklės, židiniai, viryklės (įskaitant virykles su papildomais centrinio šildymo katilais), mėsos keptuvai (barbecues), žarijų indai, dujų degikliai, plokšti šildytuvai ir panašūs neelektriniai buitiniai prietaisai bei jų dalys iš geležies arba plieno',
