    'Table, kitchen or other household articles and parts thereof, of iron or steel; iron or steel wool; pot scourers and scouring or polishing pads, gloves and the like, of iron or steel' => 'Stalo, virtuvės arba kiti namų apyvokos reikmenys bei jų dalys iš geležies arba plieno; geležies arba plieno vata; indų šveitimo plaušinės ir šveitimo arba poliravimo šluostės, pirštinės bei panašūs gaminiai iš geležies arba plieno',
