    'Aluminium casks, drums, cans, boxes and similar containers (including rigid or collapsible tubular containers), for any material (other than compressed or liquefied gas), of a capacity not exceeding 300 litres, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Cisternos, statinės, būgnai, skardinės, dėžės ir panašios aliumininės bet kurių medžiagų (išskyrus suslėgtas ir suskystintas dujas) talpyklos (įskaitant neišardomas arba išardomas cilindrines talpyklas), kurių talpa ne didesnė kaip 300 litrų, aptaisytos arba neaptaisytos, su termoizoliacija arba be termoizoliacijos, tačiau be pritvirtintos mechaninės arba šiluminės įrangos',
    'Stranded wire, cables, plaited bands and the like, of aluminium, not electrically insulated' => 'Suvyta viela, kabeliai, pintos juostos ir panašūs aliuminio dirbiniai be elektros izoliacijos',
