    'Beryllium, chromium, hafnium, rhenium, thallium, cadmium, germanium, vanadium, gallium, indium and niobium (columbium), and articles of these metals, including waste and scrap' => 'Berilis, chromas, hafnis, renis, talis, kadmis, germanis, vanadis, galis, indis ir niobis (kolumbis), bei šių metalų gaminiai, įskaitant atliekas ir laužą',
