    'Handsaws; blades for saws of all kinds (including slitting, slotting or toothless saw blades)' => 'Rankiniai pjūklai; visų rūšių pjūklų pjaunamosios dalys (įskaitant išilginio pjovimo, išpjovų pjūklų ir bedantes pjūklų pjaunamąsias dalis)',
    'Files, rasps, pliers (including cutting pliers), pincers, tweezers, metal-cutting shears, pipe-cutters, bolt croppers, perforating punches and similar hand tools' => 'Dildės, brūžikliai, plokščiareplės (įskaitant kerpančiąsias plokščiareples), žnyplės, pincetai, žnyplelės, žirklės metalui karpyti, vamzdžių karpymo įtaisai, žirklės varžtams karpyti, skylmušiai ir panašūs rankiniai įrankiai',
    'Hand-operated spanners and wrenches (including torque meter wrenches but not including tap wrenches); interchangeable spanner sockets, with or without handles' => 'Rankiniai veržliarakčiai (įskaitant veržliarakčius su sukamuoju dinamometru, bet neįskaitant sriegiklių laikiklių); keičiamos veržliarakčių galvutės, su rankenomis arba be rankenų',
    'Hand tools (including glaziers\' diamonds), not elsewhere specified or included; blowlamps; vices, clamps and the like, other than accessories for and parts of machine-tools or water-jet cutting machines; anvils; portable forges; hand- or pedal-operated grinding wheels with frameworks' => 'Rankiniai įrankiai (įskaitant deimantinius stiklo rėžtuvus), nenurodyti kitoje vietoje; litavimo lempos; spaustuvai, veržtuvai ir panašūs įrankiai, išskyrus staklių arba pjovimo vandens srove mašinų reikmenis ir detales; priekalai; kilnojamieji žaizdrai; šlifavimo (galandimo) diskai su rėmais ir su rankine arba su kojine pavara',
    'Interchangeable tools for hand tools, whether or not power-operated, or for machine tools (for example, for pressing, stamping, punching, tapping, threading, drilling, boring, broaching, milling, turning or screw driving), including dies for drawing or extruding metal, and rock-drilling or earth-boring tools' => 'Rankinių įtaisų, su varikliu arba be variklio, arba staklių ir įrengimų (pavyzdžiui, presavimo, štampavimo, perforavimo, išorinių arba vidinių sriegių sriegimo, gręžimo, tekinimo, pratraukimo, frezavimo, tekinimo arba veržimo) keičiamieji įrankiai, įskaitant metalo tempimo arba išspaudimo (ekstruzijos) (matricas) štampus, uolienų arba žemės gręžimo įrankius',
    'Knives and cutting blades, for machines or for mechanical appliances' => 'Staklių arba mechaninių įrenginių peiliai ir pjovimo geležtės',
