    'Knives with cutting blades, serrated or not (including pruning knives), other than knives of heading 8208, and blades therefor' => 'Peiliai su pjovimo geležtėmis, dantytomis arba nedantytomis (įskaitant šakelių pjaustymo arba genėjimo peilius), išskyrus peilius, priskiriamus 8208 pozicijai, ir jų geležtės',
    'Razors and razor blades (including razor blade blanks in strips)' => 'Skustuvai ir skustuvų peiliukai (įskaitant juostų pavidalo skustuvų peiliukų ruošinius)',
    'Other articles of cutlery (for example, hair clippers, butchers\' or kitchen cleavers, choppers and mincing knives, paperknives); manicure or pedicure sets and instruments (including nail files)' => 'Kiti pjovimo įrankiai (pavyzdžiui, plaukų kirpimo mašinėlės, mėsininkų arba virtuvės kirviai, kapoklės, smulkinimo peiliai, peiliai popieriui pjaustyti); manikiūro arba pedikiūro rinkiniai ir įrankiai (įskaitant nagų dildeles)',
    'Spoons, forks, ladles, skimmers, cake-servers, fish-knives, butter-knives, sugar tongs and similar kitchen or tableware' => 'Šaukštai, šakutės, samčiai, putų graibštai, torto mentelės, žuvų peiliai, sviesto peiliai, cukraus žnyplės ir panašūs virtuvės arba stalo įrankiai',
    'Padlocks and locks (key, combination or electrically operated), of base metal; clasps and frames with clasps, incorporating locks, of base metal; keys for any of the foregoing articles, of base metal' => 'Pakabinamosios ir įleidžiamosios spynos (raktinės, kodinės arba elektrinės), pagamintos iš netauriųjų metalų; skląsčiai ir rėminės konstrukcijos su skląsčiais bei spynomis, pagaminti iš netauriųjų metalų; visų pirmiau išvardytų gaminių raktai, pagaminti iš netauriųjų metalų',
    'Base-metal mountings, fittings and similar articles suitable for furniture, doors, staircases, windows, blinds, coachwork, saddlery, trunks, chests, caskets or the like; base-metal hat-racks, hat-pegs, brackets and similar fixtures; castors with mountings of base metal; automatic door closers of base metal' => 'Baldų, durų, laiptų, langų, langinių, kėbulų, balnų ir pakinktų, lagaminų, skrynių, dėžių ir panašių gaminių aptaisai, tvirtinimo ir montavimo įtaisai bei panašūs netauriųjų metalų gaminiai; skrybėlių kabyklos ir vagiai, gembės ir panašūs netauriųjų metalų gaminiai; ratukai su tvirtinimo įtaisais iš netauriųjų metalų; automatinės durų sklendės iš netauriųjų metalų',
    'Armoured or reinforced safes, strongboxes and doors and safe deposit lockers for strong-rooms, cash or deed boxes and the like, of base metal' => 'Šarvuoti arba sutvirtinti seifai, vertybių saugyklų durys ir seifai, dėžės, skirtos pinigams arba dokumentams saugoti, ir panašūs netauriųjų metalų dirbiniai',
    'Fittings for loose-leaf binders or files, letter clips, letter corners, paper clips, indexing tags and similar office articles, of base metal; staples in strips (for example, for offices, upholstery, packaging), of base metal' => 'Segtuvų arba bylų aptaisai, raštinės sąvaržėlės ir spaustukai, žymėjimo kortelės ir panašūs biuro reikmenys, pagaminti iš netauriųjų metalų; juostinių sankabėlių (pavyzdžiui, raštinės, baldų apmušalų, pakuočių), pagamintų iš netauriųjų metalų, blokai',
    'Bells, gongs and the like, non-electric, of base metal; statuettes and other ornaments, of base metal; photograph, picture or similar frames, of base metal; mirrors of base metal' => 'Varpai, gongai ir panašūs neelektriniai netauriųjų metalų dirbiniai; statulėlės ir kiti dekoratyviniai netauriųjų metalų dirbiniai; fotografijų, paveikslų arba panašūs rėmai, pagaminti iš netauriųjų metalų; veidrodžiai, pagaminti iš netauriųjų metalų',
    'Flexible tubing of base metal, with or without fittings' => 'Lankstūs vamzdžiai, pagaminti iš netauriųjų metalų, su jungiamosiomis detalėmis (fitingais) arba be jungiamųjų detalių',
    'Clasps, frames with clasps, buckles, buckle-clasps, hooks, eyes, eyelets and the like, of base metal, of a kind used for clothing or clothing accessories, footwear, jewellery, wrist watches, books, awnings, leather goods, travel goods or saddlery or for other made up articles; tubular or bifurcated rivets, of base metal; beads and spangles, of base metal' => 'Drabužių arba drabužių priedų, avalynės, bižuterijos, rankinių laikrodžių, knygų, tentų, odos dirbinių, kelionės reikmenų arba balno reikmenų ar kitų gatavų dirbinių sąsagos, rėminės konstrukcijos su sąsagomis, sagtys, sąsagos su sagtimis, kabliukai, kilpelės, ąselės ir panašūs netauriųjų metalų gaminiai; vamzdinės arba dvišakės (bifurkacinės) kniedės iš netauriųjų metalų; karoliukai ir blizgučiai iš netauriųjų metalų',
    'Stoppers, caps and lids (including crown corks, screw caps and pouring stoppers), capsules for bottles, threaded bungs, bung covers, seals and other packing accessories, of base metal' => 'Kamščiai, gaubteliai, dangteliai (įskaitant karūninius kamščius, užsukamus gaubtelius ir pilstomuosius kamščius), dangteliai, butelių aptaisai, volės (dideli kamščiai) su sriegiais, volių aptaisai, plombos ir kiti pakavimo reikmenys, pagaminti iš netauriųjų metalų',
    'Wire, rods, tubes, plates, electrodes and similar products, of base metal or of metal carbides, coated or cored with flux material, of a kind used for soldering, brazing, welding or deposition of metal or of metal carbides; wire and rods, of agglomerated base metal powder, used for metal spraying' => 'Viela, strypai, vamzdžiai, plokštės, elektrodai ir panašūs netauriųjų metalų arba metalų karbidų produktai su fliuso apvalkalais arba šerdimis, tinkami litavimui minkštuoju arba kietuoju lydmetaliu, suvirinimui arba metalų ar metalų karbidų nusodinimui; purškiamuoju būdu metalizuota viela ir strypai, pagaminti iš aglomeruotų netauriųjų metalų miltelių',
    'Nuclear reactors; fuel elements (cartridges), non-irradiated, for nuclear reactors; machinery and apparatus for isotopic separation' => 'Branduoliniai reaktoriai; nepanaudoti (neapšvitinti) branduolinių reaktorių kuro elementai (kasetės); izotopų atskyrimo įrenginiai ir aparatūra',
    'Steam or other vapour generating boilers (other than central heating hot water boilers capable also of producing low pressure steam); superheated water boilers' => 'Vandens garų arba kitų garų generavimo katilai (išskyrus centrinio šildymo karšto vandens katilus, taip pat galinčius generuoti mažo slėgio vandens garus); perkaitinto vandens katilai',
    'Central heating boilers other than those of heading 8402' => 'Centrinio šildymo katilai, išskyrus priskiriamus 8402 pozicijai',
    'Auxiliary plant for use with boilers of heading 8402 or 8403 (for example, economisers, superheaters, soot removers, gas recoverers); condensers for steam or other vapour power units' => 'Pagalbiniai įrenginiai, skirti naudoti kartu su katilais, priskiriamais 8402 arba 8403 pozicijai (pavyzdžiui, katilo šilumokaičiai, perkaitintuvai, suodžių šalintuvai, dujų rekuperatoriai); vandens garų arba kitų garų jėgainių kondensatoriai',
    'Producer gas or water gas generators, with or without their purifiers; acetylene gas generators and similar water process gas generators, with or without their purifiers' => 'Generatorinių dujų arba vandens dujų generatoriai, su valytuvais arba be jų; acetileno dujų generatoriai ir panašūs vandens proceso dujų generatoriai, su valytuvais arba be jų',
    'Steam turbines and other vapour turbines' => 'Vandens garų turbinos ir kitų garų turbinos',
    'Spark-ignition reciprocating or rotary internal combustion piston engines' => 'Stūmokliniai vidaus degimo varikliai su kibirkštiniu uždegimu ir grįžtamai slenkamuoju arba rotaciniu stūmoklio judėjimu',
    'Compression-ignition internal combustion piston engines (diesel or semi-diesel engines)' => 'Stūmokliniai vidaus degimo varikliai su slėginiu uždegimu (dyzeliniai arba pusiau dyzeliniai varikliai)',
