    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Oro kondicionavimo įrenginiai, sudaryti iš variklio varomo ventiliatoriaus ir oro temperatūros bei drėgmės kaitos elementų, įskaitant kondicionierius, kuriais oro drėgmė atskirai nereguliuojama',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Krosnių, kūrenamų skystuoju kuru, pulverizuotu kietuoju kuru arba dujomis, degikliai; mechaninės kūryklos, įskaitant jų mechanines groteles, mechaninius pelenų šalintuvus ir panašius įtaisus',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Neelektrinės pramoninės arba laboratorinės krosnys ir orkaitės, įskaitant šiukšlių deginimo ir krematoriumų krosnis',
    'Refrigerators, freezers and other refrigerating or freezing equipment, electric or other; heat pumps other than air-conditioning machines of heading 8415' => 'Šaldytuvai, šaldikliai ir kiti elektriniai arba neelektriniai šaldymo arba užšaldymo įrenginiai; šiluminiai siurbliai, išskyrus oro kondicionavimo įrenginius, priskiriamus 8415 pozicijai',
    'Machinery, plant or laboratory equipment, whether or not electrically heated (excluding furnaces, ovens and other equipment of heading 8514), for the treatment of materials by a process involving a change of temperature such as heating, cooking, roasting, distilling, rectifying, sterilising, pasteurising, steaming, drying, evaporating, vaporising, condensing or cooling, other than machinery or plant of a kind used for domestic purposes; instantaneous or storage water heaters, non-electric' => 'Mašinos, pramoniniai arba laboratoriniai įrenginiai, šildomi arba nešildomi elektra (išskyrus krosnis, orkaites ir kitus įrenginius, priskiriamus 8514 pozicijai), naudojami medžiagoms apdoroti įvairiais, su temperatūros pokyčiu susijusiais, procesais, kaip pavyzdžiui, šildymas, virimas arba kepimas, skrudinimas arba išdeginimas, distiliacija, rektifikacija, sterilizacija, pasterizacija, šutinimas vandens garais, džiovinimas, išgarinimas, garinimas, kondensacija arba šaldymas, išskyrus buitinę techniką; neelektriniai tekančio arba talpykloje laikomo vandens šildytuvai',
    'Calendering or other rolling machines, other than for metals or glass, and cylinders therefor' => 'Kalandravimo mašinos arba kitos valcavimo mašinos, išskyrus skirtas metalui arba stiklui apdoroti, ir šių mašinų velenai',
    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Centrifugos, įskaitant išcentrines (centrifugines) džiovyklas; skysčių arba dujų filtravimo arba valymo mašinos ir aparatai',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Indų plovimo mašinos; butelių arba kitų talpyklų plovimo, valymo arba džiovinimo mašinos; butelių, skardinių, dėžių, maišų arba kitų talpyklų pripildymo, uždarymo, sandarinimo arba žymėjimo (etikečių pritvirtinimo) mašinos; butelių, stiklainių, tūbelių ir panašių talpyklų uždarymo mašinos; kitos pakavimo arba vyniojimo mašinos (įskaitant vyniojimo į pakaitinus traukias (susitraukiančias) plėveles mašinas); gėrimų gazavimo mašinos',
    'Weighing machinery (excluding balances of a sensitivity of 5 cg or better), including weight-operated counting or checking machines; weighing machine weights of all kinds' => 'Svėrimo mašinos (išskyrus svarstykles, kurių jautris ne mažesnis kaip 5 cg), įskaitant masės valdomas skaičiavimo arba kontrolės mašinas; visų rūšių svėrimo mašinų svareliai',
    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Mechaniniai įtaisai (rankiniai arba kiti), skirti skysčiams arba milteliams išsvaidyti, paskleisti arba purkšti; gesintuvai, pripildyti arba nepripildyti; purkštuvai ir panašūs įtaisai; garasrovės, smėliasrovės ir panašios srovinio svaidymo mašinos',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Blokai skrysčiniai ir keltuvai, išskyrus kaušinius (skipinius) keltuvus; gervės ir špiliai (kabestanai); kėlikliai (domkratai)',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Laivų derikai (kėlimo kranai su strėlėmis); kėlimo kranai, įskaitant kabelinius kranus; mobiliosios kėlimo konstrukcijos, apžarginiai transporteriai (straddle carriers) ir sandėliuose naudojamos važiuoklės su kėlimo kranais',
    'Fork-lift trucks; other works trucks fitted with lifting or handling equipment' => 'Šakiniai krautuvai; kiti darbiniai krautuvai su kėlimo arba pernešimo įtaisais',
