    'Self-propelled bulldozers, angledozers, graders, levellers, scrapers, mechanical shovels, excavators, shovel loaders, tamping machines and roadrollers' => 'Savaeigiai buldozeriai, buldozeriai su paslankiu verstuvu (angledozers), greideriai, lygintuvai, skreperiai, mechaniniai semtuvai, ekskavatoriai, vienkaušiai krautuvai, plūktuvai ir plentvoliai',
    'Other moving, grading, levelling, scraping, excavating, tamping, compacting, extracting or boring machinery, for earth, minerals or ores; piledrivers and pile extractors; snowploughs and snowblowers' => 'Kiti, žemės, mineralų arba rūdų perstūmos, rūšiavimo, išlyginimo, grandymo, kasimo, plūkimo, sutankinimo, ištraukimo arba gręžimo mašinos; poliakalės ir poliatraukės; plūginiai ir rotoriniai sniego valytuvai',
    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Dalys, tinkančios vien tik arba daugiausia mašinoms, priskiriamoms 8425–8430 pozicijoms',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Žemės ūkio, sodininkystės arba miškų ūkio mašinos, naudojamos dirvai paruošti arba dirbti; volai vejoms arba sporto aikštelėms voluoti',
    'Harvesting or threshing machinery, including straw or fodder balers; grass or hay mowers; machines for cleaning, sorting or grading eggs, fruit or other agricultural produce, other than machinery of heading 8437' => 'Javapjovės, derliaus nuėmimo arba kuliamosios mašinos, įskaitant šiaudų arba šieno presus arba presus-rinktuvus; vejapjovės arba šienapjovės; kiaušinių, vaisių arba kitų žemės ūkio produktų valymo, rūšiavimo arba atrankos mašinos, išskyrus mašinas, priskiriamas 8437 pozicijai',
    'Milking machines and dairy machinery' => 'Melžimo bei pienininkystės mašinos',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Presai, smulkintuvai ir panašios mašinos, naudojamos vynininkystėje, sidro, vaisių sulčių arba panašių gėrimų gamyboje',
