    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Sėklų, grūdų arba džiovintų ankštinių daržo augalų valymo, rūšiavimo arba atrankos mašinos; malybos pramonės arba javų grūdų ar džiovintų ankštinių daržo augalų apdorojimo mašinos, išskyrus ūkininko ūkyje naudojamas mašinas',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Kitos mašinos, nenurodytos kitoje šio skirsnio vietoje, naudojamos maisto produktų arba gėrimų pramoniniam paruošimui arba gamybai, išskyrus gyvūninių, nelakiųjų augalinių arba mikroorganizmų riebalų ar aliejų ekstrahavimo arba paruošimo mašinas',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Pluoštinių celiuliozinių medžiagų plaušienos gamybos, popieriaus arba kartono gamybos arba apdailos mašinos',
    'Bookbinding machinery, including book-sewing machines' => 'Knygų rišimo mašinos, įskaitant brošiūravimo mašinas',
