    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Mašinos, aparatai ir įranga (išskyrus mašinas, priskiriamas 8456–8465 pozicijoms), skirti plokštėms, cilindrams arba kitiems spaudos elementams paruošti arba gaminti; plokštės, cilindrai ir kiti spaudos elementai; plokštės, cilindrai ir litografiniai akmenys, paruošti naudoti spaudai (pavyzdžiui, nulyginti, šlifuoti arba poliruoti)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Spaudos mašinos, spausdinančios naudojant plokštes, cilindrus ir kitus spaudos elementus, priskiriamus 8442 pozicijai; kiti spausdintuvai, kopijavimo ir faksimiliniai aparatai, kombinuoti arba nekombinuoti; jų dalys ir reikmenys',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Cheminių tekstilės medžiagų išspaudimo (ekstruzijos), pratempimo, tekstūravimo arba pjaustymo mašinos',
