    'Auxiliary machinery for use with machines of heading 8444, 8445, 8446 or 8447 (for example, dobbies, jacquards, automatic stop motions, shuttle changing mechanisms); parts and accessories suitable for use solely or principally with the machines of this heading or of heading 8444, 8445, 8446 or 8447 (for example, spindles and spindle flyers, card clothing, combs, extruding nipples, shuttles, healds and heald-frames, hosiery needles)' => 'Pagalbinės mašinos, naudojamos kartu su mašinomis, priskiriamomis 8444, 8445, 8446 arba 8447 pozicijai (pavyzdžiui, nytkėlės mechanizmai, žakardo mašinos, automatinio sustabdymo įtaisai ir šaudyklių pakeitimo mechanizmai); dalys ir pagalbinė įranga, naudojama vien tik arba daugiausia su mašinomis, priskiriamomis šiai pozicijai arba 8444, 8445, 8446 ar 8447 pozicijai (pavyzdžiui, verpstės ir sparninės verpstės, karštuvų garnitūrai, šukos, filjerės, šaudyklės, nytelės ir nytys, mezgimo adatos)',
    'Household or laundry-type washing machines, including machines which both wash and dry' => 'Buitinės arba skalbyklose naudojamos skalbyklės, įskaitant mašinas, atliekančias skalbimo ir džiovinimo funkcijas',
    'Machinery (other than machines of heading 8450) for washing, cleaning, wringing, drying, ironing, pressing (including fusing presses), bleaching, dyeing, dressing, finishing, coating or impregnating textile yarns, fabrics or made-up textile articles and machines for applying the paste to the base fabric or other support used in the manufacture of floor coverings such as linoleum; machines for reeling, unreeling, folding, cutting or pinking textile fabrics' => 'Mašinos (išskyrus mašinas, priskiriamas 8450 pozicijai), naudojamos tekstilės siūlams, tekstilės gaminiams arba gataviems tekstilės dirbiniams skalbti, valyti, gręžti, džiovinti, lyginti, presuoti (įskaitant laminavimo presus), balinti, dažyti, taurinti, dailinti, padengti arba įmirkyti, ir mašinos, užtepančios pastos sluoksnį ant tekstilės audinio arba ant kito pagrindo, naudojamos linoleumo ir panašių grindų dangų gamyboje; tekstilės gaminių vyniojimo į rietimus, išvyniojimo iš rietimų, dvilinkavimo, kirpimo ir kraštų apkirpimo dantukais mašinos',
    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Siuvamosios mašinos, išskyrus brošiūravimo mašinas, priskiriamas 8440 pozicijai; baldai, stovai ir dangčiai, specialiai pritaikyti siuvamosioms mašinoms; siuvamųjų mašinų adatos',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Mašinos, naudojamos kailiams, žaliaminėms odoms arba išdirbtoms odoms paruošti, rauginti arba išdirbti, avalynei arba kitiems dirbiniams iš kailių, žaliaminių odų ir išdirbtų odų gaminti arba taisyti, išskyrus siuvamąsias mašinas',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Konverteriai, liejimo kaušai, formadėžės ir liejimo mašinos, naudojamos metalurgijoje arba liejininkystėje',
    'Metal-rolling mills and rolls therefor' => 'Metalo valcavimo staklynai ir jų velenai',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Staklės, naudojamos bet kurioms medžiagoms apdirbti pašalinant dalį medžiagos lazerio spinduliuote arba kitais šviesos ar fotonų pluoštais, ultragarsu, elektros iškrova, naudojant elektrocheminius procesus, elektronų pluoštą arba plazmos lanką; pjovimo vandens srove mašinos',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Mechaninio apdirbimo centrai, vienpozicinės ir daugiapozicinės agregatinės metalo apdirbimo staklės',
    'Lathes (including turning centres) for removing metal' => 'Metalo tekinimo staklės (įskaitant tekinimo centrus)',
    'Machine tools (including way-type unit head machines) for drilling, boring, milling, threading or tapping by removing metal, other than lathes (including turning centres) of heading 8458' => 'Gręžimo, ištekinimo, frezavimo, sriegių sriegimo arba įsriegimo, pašalinant dalį metalo, staklės (įskaitant linijines agregatines stakles), išskyrus tekinimo stakles (taip pat ir tekinimo centrus), priskiriamas 8458 pozicijai',
    'Machine tools for deburring, sharpening, grinding, honing, lapping, polishing or otherwise finishing metal or cermets by means of grinding stones, abrasives or polishing products, other than gear cutting, gear grinding or gear finishing machines of heading 8461' => 'Šerpetų pašalinimo, galandimo, šlifavimo, honingavimo, pritrynimo, poliravimo ar kitos metalo arba kermetų apdailos staklės, veikiančios naudojant šlifavimo diskus, abrazyvines arba poliravimo medžiagas, išskyrus krumplių pjovimo, krumplių šlifavimo ir krumplių apdailos stakles, priskiriamas 8461 pozicijai',
    'Machine tools for planing, shaping, slotting, broaching, gear cutting, gear grinding or gear finishing, sawing, cutting-off and other machine tools working by removing metal or cermets, not elsewhere specified or included' => 'Metalo arba kermetų išilginio drožimo, skersinio drožimo, vertikaliojo drožimo, pratraukimo, krumplių pjovimo, krumplių šlifavimo, krumplių apdailos, pjaustymo, atpjovimo staklės ir kitos metalo arba kermetų apdirbimo pašalinant dalį metalo arba kermetų staklės, nenurodytos kitoje vietoje',
