    'Other machine tools for working metal or cermets, without removing material' => 'Kitos metalo arba kermetų apdorojimo nepašalinant dalies medžiagos staklės',
    'Machine tools for working stone, ceramics, concrete, asbestos-cement or like mineral materials or for cold working glass' => 'Akmenų, keramikos, betono, asbestcemenčio arba panašių mineralinių medžiagų apdirbimo staklės ir šaltojo stiklo apdirbimo staklės',
    'Machine tools (including machines for nailing, stapling, glueing or otherwise assembling) for working wood, cork, bone, hard rubber, hard plastics or similar hard materials' => 'Medienos, kamštienos, kaulų, kietosios gumos, kietųjų plastikų arba panašių kietųjų medžiagų apdirbimo staklės (įskaitant stiprinimo vinimis arba sąvaržų kalimo, klijavimo arba kitas surinkimo stakles)',
    'Parts and accessories suitable for use solely or principally with the machines of headings 8456 to 8465, including work or tool holders, self-opening dieheads, dividing heads and other special attachments for the machines; tool holders for any type of tool for working in the hand' => 'Dalys ir reikmenys, tinkami vien tik arba daugiausia staklėms, priskiriamoms 8456–8465 pozicijoms, įskaitant apdirbamų ruošinių arba įrankių laikiklius, atsiveriančiąsias sriegimo galvutes, dalijimo galvutes ir kitus specialiuosius mašinų įtaisus; visų rūšių rankų darbui skirtų įrankių laikikliai',
    'Tools for working in the hand, pneumatic, hydraulic or with self-contained electric or non-electric motor' => 'Rankų darbui skirti įrankiai, pneumatiniai, hidrauliniai arba su įmontuotu elektros ar ne elektros varikliu',
    'Machinery and apparatus for soldering, brazing or welding, whether or not capable of cutting, other than those of heading 8515; gas-operated surface tempering machines and appliances' => 'Litavimo ar kietojo litavimo arba suvirinimo mašinos ir aparatai, pritaikyti arba nepritaikyti naudoti pjaustymui, išskyrus priskiriamus 8515 pozicijai; dujinės paviršiaus šiluminio apdorojimo mašinos ir aparatai',
    'Calculating machines and pocket-size data-recording, reproducing and displaying machines with calculating functions; accounting machines, postage-franking machines, ticket-issuing machines and similar machines, incorporating a calculating device; cash registers' => 'Skaičiavimo mašinos ir kišeninės duomenų įrašymo, atkūrimo ir rodymo ekrane mašinėlės, atliekančios skaičiavimo funkcijas; apskaitos mašinos, pašto siuntų frankavimo mašinos, bilietų išdavimo mašinos ir panašios mašinos su skaičiavimo įtaisais; kasos aparatai',
    'Automatic data-processing machines and units thereof; magnetic or optical readers, machines for transcribing data onto data media in coded form and machines for processing such data, not elsewhere specified or included' => 'Automatinio duomenų apdorojimo mašinos ir jų įtaisai; magnetiniai arba optiniai (duomenų) skaitymo skaitliai, užkoduotų duomenų perrašymo į informacijos laikmenas mašinos ir tokių duomenų apdorojimo mašinos, nenurodytos kitoje vietoje',
    'Other office machines (for example, hectograph or stencil duplicating machines, addressing machines, automatic banknote dispensers, coin-sorting machines, coin-counting or -wrapping machines, pencil-sharpening machines, perforating or stapling machines)' => 'Kitos biuro mašinos (pavyzdžiui, hektografai arba rotorinės spaudos mašinos, adresavimo mašinos, banknotų išdavimo automatai, monetų rūšiavimo, skaičiavimo arba pakavimo mašinos, pieštukų drožtuvai, perforavimo arba susegimo apkabėlėmis mašinos)',
    'Parts and accessories (other than covers, carrying cases and the like) suitable for use solely or principally with machines of headings 8470 to 8472' => 'Dalys ir reikmenys (išskyrus dangčius, futliarus ir panašius dirbinius), skirti vien tik arba daugiausia mašinoms, priskiriamoms 8470–8472 pozicijoms',
    'Machinery for sorting, screening, separating, washing, crushing, grinding, mixing or kneading earth, stone, ores or other mineral substances, in solid (including powder or paste) form; machinery for agglomerating, shaping or moulding solid mineral fuels, ceramic paste, unhardened cements, plastering materials or other mineral products in powder or paste form; machines for forming foundry moulds of sand' => 'Grunto (žemės), akmenų, rūdų arba kitų mineralinių medžiagų, esančių kietame būvyje (įskaitant miltelius ir pastas), rūšiavimo, sijojimo, atskyrimo, plovimo, trupinimo, malimo, maišymo arba minkymo mašinos; kieto mineralinio kuro, minkytų keraminių medžiagų, nesukietėjusių cementų, tinkavimo medžiagų arba kitų miltelių arba pastos pavidalo mineralinių produktų aglomeravimo, formavimo arba liejimo mašinos; smėlinių liejimo formų formavimo mašinos',
    'Machines for assembling electric or electronic lamps, tubes or valves or flashbulbs, in glass envelopes; machines for manufacturing or hot working glass or glassware' => 'Elektros arba elektroninių lempų, elektroninių vamzdžių arba fotoblyksčių lempų su stikliniais gaubtais surinkimo mašinos; stiklo arba stiklo dirbinių gamybos arba karštojo apdirbimo mašinos',
    'Automatic goods-vending machines (for example, postage stamp, cigarette, food or beverage machines), including money-changing machines' => 'Prekybos automatai (pavyzdžiui, pašto ženklų, cigarečių, maisto produktų arba gėrimų prekybos automatai), įskaitant pinigų keitimo automatus',
    'Machinery for working rubber or plastics or for the manufacture of products from these materials, not specified or included elsewhere in this chapter' => 'Gumos (kaučiuko) arba plastikų apdirbimo mašinos ir šių medžiagų produktų gamybos mašinos, nenurodytos kitoje šio skirsnio vietoje',
    'Machinery for preparing or making up tobacco, not specified or included elsewhere in this chapter' => 'Tabako paruošimo arba perdirbimo mašinos, nenurodytos kitoje šio skirsnio vietoje',
    'Machines and mechanical appliances having individual functions, not specified or included elsewhere in this chapter' => 'Mašinos ir mechaniniai įrenginiai, atliekantys tam tikras jiems būdingas funkcijas, nenurodytas kitoje šio skirsnio vietoje',
    'Moulding boxes for metal foundry; mould bases; moulding patterns; moulds for metal (other than ingot moulds), metal carbides, glass, mineral materials, rubber or plastics' => 'Metalo liejimo formadėžės; liejimo padėklai; liejimo modeliai; metalo, metalų karbidų, stiklo, mineralinių medžiagų, gumos arba plastikų liejimo formos (išskyrus luitadėžes)',
    'Taps, cocks, valves and similar appliances for pipes, boiler shells, tanks, vats or the like, including pressure-reducing valves and thermostatically controlled valves' => 'Čiaupai, ventiliai, vožtuvai ir panašūs vamzdynų, kaitrovamzdžių, katilų, rezervuarų, cisternų, bakų ir panašių dirbinių įtaisai, įskaitant slėgio mažinamuosius (redukcinius) ir termostatinius reguliuojamuosius vožtuvus',
    'Ball or roller bearings' => 'Rutuliniai arba ritininiai guoliai',
    'Transmission shafts (including cam shafts and crank shafts) and cranks; bearing housings and plain shaft bearings; gears and gearing; ball or roller screws; gear boxes and other speed changers, including torque converters; flywheels and pulleys, including pulley blocks; clutches and shaft couplings (including universal joints)' => 'Transmisijos velenai (įskaitant kumštelinius velenus ir alkūninius velenus) ir skriejiko velenai; guolių korpusai ir slydimo guoliai; krumpliniai mechanizmai ir krumplinės pavaros; rutuliniai arba ritininiai pavarų sraigtai; pavarų dėžės ir kiti greičio keitikliai (reduktoriai), įskaitant hidrotransformatorius; smagračiai ir skriemuliai, įskaitant skrysčius; sankabos ir sankabos velenų movos (įskaitant universalius šarnyrus)',
    'Gaskets and similar joints of metal sheeting combined with other material or of two or more layers of metal; sets or assortments of gaskets and similar joints, dissimilar in composition, put up in pouches, envelopes or similar packings; mechanical seals' => 'Tarpikliai ir panašios jungtys iš lakštinio metalo, kombinuoto su kitomis medžiagomis, arba iš dviejų ar daugiau metalo sluoksnių; tarpiklių ir panašių jungčių, kurių sandara skirtinga, rinkiniai arba komplektai, supakuoti į maišelius, vokus arba panašias pakuotes; mechaniniai sandarikliai',
    'Machines for additive manufacturing' => 'Adityviosios gamybos mašinos',
    'Machines and apparatus of a kind used solely or principally for the manufacture of semiconductor boules or wafers, semiconductor devices, electronic integrated circuits or flat panel displays; machines and apparatus specified in note 11(C) to this chapter; parts and accessories' => 'Mašinos ir aparatai, naudojami vien tik arba daugiausia puslaidininkių ruošiniams ar plokštelėms, puslaidininkiniams įtaisams, elektroniniams integriniams grandynams ar plokštiesiems vaizduokliams gaminti; mašinos ir aparatai, nurodyti šio skirsnio 11 pastabos C dalyje; dalys ir reikmenys',
    'Machinery parts, not containing electrical connectors, insulators, coils, contacts or other electrical features, not specified or included elsewhere in this chapter' => 'Mašinų dalys be elektrinių jungčių, izoliatorių, ričių, kontaktų arba kitų elektros detalių, nenurodytos kitoje šio skirsnio vietoje',
    'Electric motors and generators (excluding generating sets)' => 'Elektros varikliai ir generatoriai (išskyrus generatorinius agregatus)',
    'Electric generating sets and rotary converters' => 'Elektros generatoriniai agregatai ir vieninkariai elektros keitikliai',
    'Parts suitable for use solely or principally with the machines of heading 8501 or 8502' => 'Dalys, skirtos vien tik arba daugiausia su mašinomis, priskiriamomis 8501 arba 8502 pozicijai',
    'Electrical transformers, static converters (for example, rectifiers) and inductors' => 'Elektros transformatoriai, statiniai keitikliai (pavyzdžiui, lygintuvai) ir induktoriai',
    'Electromagnets; permanent magnets and articles intended to become permanent magnets after magnetisation; electromagnetic or permanent magnet chucks, clamps and similar holding devices; electromagnetic couplings, clutches and brakes; electromagnetic lifting heads' => 'Elektromagnetai; nuolatiniai magnetai ir gaminiai, kurie po įmagnetinimo gali tapti nuolatiniais magnetais; griebtuvai, spaustuvai ir panašūs laikikliai su elektromagnetais arba nuolatiniais magnetais; elektromagnetinės reguliuojamosios ir nereguliuojamosios sankabos bei stabdžiai; elektromagnetiniai kėlimo įrenginiai',
    'Primary cells and primary batteries' => 'Galvaniniai elementai ir galvaninės baterijos',
    'Electric accumulators, including separators therefor, whether or not rectangular (including square)' => 'Elektros akumuliatoriai, įskaitant jų skirtuvus (separatorius), stačiakampius (įskaitant kvadratinius) arba ne stačiakampius',
    'Vacuum cleaners' => 'Dulkių ir panašūs siurbliai',
    'Electromechanical domestic appliances, with self-contained electric motor, other than vacuum cleaners of heading 8508' => 'Elektromechaniniai buitiniai prietaisai su įmontuotu elektros varikliu, išskyrus 8508 pozicijai priskiriamus dulkių ir panašius siurblius',
    'Shavers, hair clippers and hair-removing appliances, with self-contained electric motor' => 'Skustuvai, plaukų kirpimo mašinėlės ir kiti plaukų šalinimo įtaisai su įmontuotu elektros varikliu',
    'Electrical ignition or starting equipment of a kind used for spark-ignition or compression-ignition internal combustion engines (for example, ignition magnetos, magneto-dynamos, ignition coils, sparking plugs and glow plugs, starter motors); generators (for example, dynamos, alternators) and cut-outs of a kind used in conjunction with such engines' => 'Elektros uždegimo arba paleidimo įranga, naudojama kibirkštinio arba slėginio uždegimo vidaus degimo varikliuose (pavyzdžiui, uždegimo magnetos, magnetų generatoriai, uždegimo ritės, uždegimo žvakės, kaitinimo žvakės, paleidimo varikliai); generatoriai (pavyzdžiui, nuolatinės arba kintamosios srovės) ir išjungikliai, naudojami kartu su šiais varikliais',
    'Electrical lighting or signalling equipment (excluding articles of heading 8539), windscreen wipers, defrosters and demisters, of a kind used for cycles or motor vehicles' => 'Elektrinė šviesos arba signalizacijos įranga (išskyrus gaminius, priskiriamus 8539 pozicijai), stiklų valytuvai ir apsaugos nuo stiklų apšalimo ir aprasojimo įranga, skirti dviračiams ir panašioms transporto priemonėms, motociklams arba autotransporto priemonėms',
    'Portable electric lamps designed to function by their own source of energy (for example, dry batteries, accumulators, magnetos), other than lighting equipment of heading 8512' => 'Nešiojamieji elektriniai žibintai, maitinami iš nuosavojo elektros energijos šaltinio (pavyzdžiui, sausųjų baterijų, akumuliatorių, magnetų), išskyrus šviesos įrangą, priskiriamą 8512 pozicijai',
    'Industrial or laboratory electric furnaces and ovens (including those functioning by induction or dielectric loss); other industrial or laboratory equipment for the heat treatment of materials by induction or dielectric loss' => 'Pramoninės arba laboratorinės elektrinės krosnys ir orkaitės (įskaitant veikiančias taikant indukcijos arba dielektrinių nuostolių principą); kiti pramoniniai arba laboratoriniai terminio medžiagų apdorojimo įrenginiai, veikiantys taikant indukcijos arba dielektrinių nuostolių principą',
    'Electric (including electrically heated gas), laser or other light or photon beam, ultrasonic, electron beam, magnetic pulse or plasma arc soldering, brazing or welding machines and apparatus, whether or not capable of cutting; electric machines and apparatus for hot spraying of metals or cermets' => 'Elektros (įskaitant naudojančias elektra kaitinamąsias dujas), lazerio ar kitų šviesų arba fotonų pluošto, ultragarso, elektronų pluošto, magnetinio impulso arba plazmos lanku litavimo, kietojo litavimo arba suvirinimo mašinos ir aparatai, atliekantys ar neatliekantys pjaustymą; elektrinės metalų arba kermetų karštojo purškimo mašinos ir aparatai',
    'Electric instantaneous or storage water heaters and immersion heaters; electric space-heating apparatus and soil-heating apparatus; electrothermic hairdressing apparatus (for example, hairdryers, hair curlers, curling tong heaters) and hand dryers; electric smoothing irons; other electrothermic appliances of a kind used for domestic purposes; electric heating resistors, other than those of heading 8545' => 'Elektriniai tekančiojo arba talpykloje laikomo vandens šildytuvai ir panardinamieji šildytuvai; elektriniai patalpų šildymo aparatai ir dirvos šildymo aparatai; elektroterminiai šukuosenų aparatai (pavyzdžiui, plaukų džiovintuvai, plaukų suktuvai, kaitrinės plaukų sukimo žnyplės) ir rankų džiovintuvai; elektrinės laidynės; kiti buitiniai elektroterminiai prietaisai; varžiniai elektriniai kaitinimo elementai, išskyrus priskiriamus 8545 pozicijai',
    'Telephone sets, including smartphones and other telephones for cellular networks or for other wireless networks; other apparatus for the transmission or reception of voice, images or other data, including apparatus for communication in a wired or wireless network (such as a local or wide area network), other than transmission or reception apparatus of heading 8443, 8525, 8527 or 8528' => 'Telefono aparatai, įskaitant išmaniuosius telefonus ir kitus koriniams tinklams arba kitiems belaidžiams tinklams skirtus telefonus; kita balso, vaizdo ar kitų duomenų perdavimo arba priėmimo aparatūra, įskaitant aparatūrą, skirtą laidinio ar belaidžio tinklo ryšiui (pavyzdžiui, vietiniam ar plačiajam tinklui), išskyrus perdavimo arba priėmimo aparatūrą, priskiriamą 8443, 8525, 8527 arba 8528 pozicijai',
    'Microphones and stands therefor; loudspeakers, whether or not mounted in their enclosures; headphones and earphones, whether or not combined with a microphone, and sets consisting of a microphone and one or more loudspeakers; audio-frequency electric amplifiers; electric sound amplifier sets' => 'Mikrofonai ir jų stovai; garsiakalbiai, sumontuoti arba nesumontuoti korpusuose; ausinės, uždedamos ant galvos arba įdedamos į ausį, sumontuotos atskirai arba kartu su mikrofonu, ir rinkiniai, sudaryti iš mikrofono ir vieno ar kelių garsiakalbių; elektriniai garsinio dažnio stiprintuvai; elektriniai garso stiprintuvai',
    'Sound recording or sound reproducing apparatus' => 'Garso įrašymo arba atkūrimo aparatai',
    'Video recording or reproducing apparatus, whether or not incorporating a video tuner' => 'Vaizdo įrašymo arba atkūrimo aparatai, su imtuviniais vaizdo derintuvais (tiuneriais) arba be jų',
    'Parts and accessories suitable for use solely or principally with the apparatus of heading 8519 or 8521' => 'Dalys ir reikmenys, tinkami vien tik arba daugiausia aparatams, priskiriamiems 8519 arba 8521 pozicijai',
    'Discs, tapes, solid-state non-volatile storage devices, smart cards and other media for the recording of sound or of other phenomena, whether or not recorded, including matrices and masters for the production of discs, but excluding products of Chapter 37' => 'Diskai, juostos, kietosios būsenos išliekamosios atmintinės, lustinės kortelės ir kitos laikmenos, skirtos garsui ar kitiems reiškiniams įrašyti, įrašytos arba neįrašytos, įskaitant diskų gamyboje naudojamas matricas ir ruošinius, bet išskyrus gaminius, priskiriamus 37 skirsniui',
    'Flat panel display modules, whether or not incorporating touch-sensitive screens' => 'Plokščiųjų vaizduoklių moduliai su jutikliniais ekranais arba be jų',
    'Transmission apparatus for radio-broadcasting or television, whether or not incorporating reception apparatus or sound recording or reproducing apparatus; television cameras, digital cameras and video camera recorders' => 'Radijo transliacijos arba televizinio signalo perdavimo aparatūra, su priėmimo arba garso įrašymo ar atkūrimo aparatūra arba be jos; televizijos kameros, skaitmeniniai fotoaparatai ir vaizdo kameros su vaizdo įrašymo įrenginiu',
    'Radar apparatus, radio navigational aid apparatus and radio remote control apparatus' => 'Radarai, radionavigaciniai ir nuotolinio valdymo radijo bangomis aparatai',
    'Reception apparatus for radio-broadcasting, whether or not combined, in the same housing, with sound recording or reproducing apparatus or a clock' => 'Radijo transliacijos priėmimo aparatūra, su kuria kartu viename korpuse sumontuota arba nesumontuota garso įrašymo ar garso atkūrimo aparatūra arba laikrodis',
    'Monitors and projectors, not incorporating television reception apparatus; reception apparatus for television, whether or not incorporating radio-broadcast receivers or sound or video recording or reproducing apparatus' => 'Monitoriai ir projektoriai, be televizinio signalo priėmimo aparatūros; televizinio signalo priėmimo aparatūra, su radijo imtuvais arba su garso ar vaizdo įrašymo arba atkūrimo aparatais arba be jų',
    'Parts suitable for use solely or principally with the apparatus of headings 8524 to 8528' => 'Dalys, tinkamos naudoti vien tik arba daugiausia su aparatais, priskiriamais 8524 – 8528 pozicijoms',
    'Electrical signalling, safety or traffic control equipment for railways, tramways, roads, inland waterways, parking facilities, port installations or airfields (other than those of heading 8608)' => 'Geležinkelių, tramvajų bėgių, kelių, vidaus vandenų kelių, stovėjimo aikštelių, uostų ir oro uostų signalizacijos, saugos arba eismo reguliavimo elektros įranga (išskyrus įrangą, priskiriamą 8608 pozicijai)',
    'Electric sound or visual signalling apparatus (for example, bells, sirens, indicator panels, burglar or fire alarms), other than those of heading 8512 or 8530' => 'Elektriniai garso arba vaizdo signalizacijos aparatai (pavyzdžiui, skambučiai, sirenos, švieslentės, apsaugos nuo įsilaužimo arba priešgaisrinės signalizacijos įranga), išskyrus įrangą, priskiriamą 8512 arba 8530 pozicijai',
    'Electrical capacitors, fixed, variable or adjustable (pre-set)' => 'Pastovieji, kintamieji arba paderinamieji elektros kondensatoriai',
    'Electrical resistors (including rheostats and potentiometers), other than heating resistors' => 'Elektros varžai (įskaitant reostatus ir potenciometrus), išskyrus kaitinamuosius varžus',
    'Printed circuits' => 'Spausdintinės grandinės',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, fuses, lightning arresters, voltage limiters, surge suppressors, plugs and other connectors, junction boxes), for a voltage exceeding 1000 V' => 'Elektros aparatūra, naudojama elektros grandinėms įjungti, išjungti, perjungti ar apsaugoti, taip pat elektros grandinėms prijungti arba sujungti (pavyzdžiui, jungikliai, saugikliai, žaibolaidžiai, įtampos ribotuvai, viršįtampių slopintuvai, kištukai ir kitos jungtys, jungiamosios dėžės), skirta aukštesnei kaip 1000 V įtampai',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, relays, fuses, surge suppressors, plugs, sockets, lamp holders and other connectors, junction boxes), for a voltage not exceeding 1000 V; connectors for optical fibres, optical fibre bundles or cables' => 'Elektros aparatūra, naudojama elektros grandinėms įjungti, išjungti, perjungti ar apsaugoti, taip pat elektros grandinėms prijungti arba sujungti (pavyzdžiui, jungikliai, relės, saugikliai, viršįtampių slopintuvai, kištukai, kištukiniai lizdai, elektros lempų laikikliai ir kitos jungtys, jungiamosios dėžutės), skirta ne aukštesnei kaip 1000 V įtampai; šviesolaidžių, šviesolaidžių grįžčių arba kabelių jungtys',
    'Boards, panels, consoles, desks, cabinets and other bases, equipped with two or more apparatus of heading 8535 or 8536, for electric control or the distribution of electricity, including those incorporating instruments or apparatus of Chapter 90, and numerical control apparatus, other than switching apparatus of heading 8517' => 'Skydai, plokštės, pultai, stendai, skirstomosios spintos ir kiti konstrukcijų pagrindai, kuriuose sumontuoti ne mažiau kaip du aparatai, priskiriami 8535 arba 8536 pozicijai, naudojami elektros srovės valdymui arba paskirstymui, įskaitant konstrukcijų pagrindus, kuriuose sumontuoti prietaisai arba aparatai, priskiriami 90 skirsniui, ir skaitmeninio programinio valdymo aparatai, tačiau neįskaitant komutatorių, priskiriamų 8517 pozicijai',
    'Parts suitable for use solely or principally with the apparatus of heading 8535, 8536 or 8537' => 'Dalys, tinkamos naudoti vien tik arba daugiausia su aparatais, priskiriamais 8535, 8536 arba 8537 pozicijai',
    'Electric filament or discharge lamps, including sealed beam lamp units and ultraviolet or infra-red lamps; arc-lamps; light-emitting diode (LED) light sources' => 'Kaitinamosios elektros arba dujošvytės lempos, įskaitant sandarias kryptinių spindulių ir ultravioletines arba infraraudonąsias lempas; lankinės lempos; šviesos diodų (LED) šviesos šaltiniai',
    'Thermionic, cold cathode or photocathode valves and tubes (for example, vacuum or vapour or gas filled valves and tubes, mercury arc rectifying valves and tubes, cathode ray tubes, television camera tubes)' => 'Elektroninės lempos ir elektroniniai vamzdžiai, su termoelektroniniais katodais, šaltaisiais katodais ar fotokatodais (pavyzdžiui, vakuuminės, garų ar dujų lempos ir vamzdžiai, gyvsidabrio lygintuvinės lempos ir vamzdžiai, elektroniniai vamzdžiai, televizijos kamerų vamzdžiai)',
    'Semiconductor devices (for example, diodes, transistors, semiconductor-based transducers); photosensitive semiconductor devices, including photovoltaic cells whether or not assembled in modules or made up into panels; light-emitting diodes (LED), whether or not assembled with other light-emitting diodes (LED); mounted piezo-electric crystals' => 'Puslaidininkiniai įtaisai (pavyzdžiui, diodai, tranzistoriai ir puslaidininkiniai keitliai); šviesai jautrūs puslaidininkiniai įtaisai, įskaitant fotovoltinius elementus, sumontuoti arba nesumontuoti moduliuose arba plokštėse; šviesos diodai (LED), sumontuoti arba nesumontuoti su kitais šviesos diodais (LED); sumontuoti pjezoelektriniai kristalai',
    'Electronic integrated circuits' => 'Elektroniniai integriniai grandynai',
    'Electrical machines and apparatus, having individual functions, not specified or included elsewhere in this chapter' => 'Elektros mašinos ir aparatai, atliekantys tam tikras jiems būdingas funkcijas, nenurodytas kitoje šio skirsnio vietoje',
    'Insulated (including enamelled or anodised) wire, cable (including coaxial cable) and other insulated electric conductors, whether or not fitted with connectors; optical fibre cables, made up of individually sheathed fibres, whether or not assembled with electric conductors or fitted with connectors' => 'Izoliuotieji (įskaitant emaliuotuosius arba anoduotuosius) laidai, kabeliai (įskaitant bendraašius kabelius) ir kiti izoliuotieji elektros laidininkai, su pritvirtintomis jungtimis arba be jų; šviesolaidžių kabeliai, sudaryti iš atskirų aptrauktų šviesolaidžių, sumontuoti arba nesumontuoti kartu su elektros laidininkais, su pritvirtintomis jungtimis arba be jų',
    'Carbon electrodes, carbon brushes, lamp carbons, battery carbons and other articles of graphite or other carbon, with or without metal, of a kind used for electrical purposes' => 'Angliniai elektrodai, angliniai šepetėliai, lempų angliukai, baterijų angliukai ir kiti grafito arba kiti anglies gaminiai, turintys metalo arba jo neturintys, naudojami elektrotechnikoje',
    'Electrical insulators of any material' => 'Elektros izoliatoriai iš bet kurių medžiagų',
    'Insulating fittings for electrical machines, appliances or equipment, being fittings wholly of insulating material apart from any minor components of metal (for example, threaded sockets) incorporated during moulding solely for purposes of assembly, other than insulators of heading 8546; electrical conduit tubing and joints therefor, of base metal lined with insulating material' => 'Elektros mašinų, aparatų arba įrangos izoliaciniai įtaisai, išskyrus izoliatorius, priskiriamus 8546 pozicijai, pagaminti vien tik iš izoliacinių medžiagų, neįskaitant smulkių metalinių detalių (pavyzdžiui, lizdų su sriegiais), įdėtų formavimo metu ir skirtų tik dirbiniui surinkti; elektros grandinių izoliaciniai vamzdeliai ir jų jungtys, pagaminti iš netauriųjų metalų, padengtų izoliacinėmis medžiagomis',
    'Electrical parts of machinery or apparatus, not specified or included elsewhere in this chapter' => 'Mašinų arba aparatų elektros įrangos dalys, nenurodytos kitoje šio skirsnio vietoje',
    'Electrical and electronic waste and scrap' => 'Elektros ir elektroninės įrangos atliekos ir laužas',
    'Rail locomotives powered from an external source of electricity or by electric accumulators' => 'Lokomotyvai, maitinami išorinio elektros energijos šaltinio arba elektros akumuliatorių',
    'Other rail locomotives; locomotive tenders' => 'Kiti lokomotyvai; lokomotyvų tenderiai',
    'Self-propelled railway or tramway coaches, vans and trucks, other than those of heading 8604' => 'Keleiviniai savaeigiai geležinkelio arba tramvajaus vagonai, prekiniai vagonai ir pusvagoniai (atviros platformos), išskyrus priskiriamus 8604 pozicijai',
    'Railway or tramway goods vans and wagons, not self-propelled' => 'Nesavaeigiai prekiniai geležinkelio arba tramvajaus vagonai',
    'Parts of railway or tramway locomotives or rolling stock' => 'Geležinkelio arba tramvajaus lokomotyvų arba riedmenų dalys',
    'Containers (including containers for the transport of fluids) specially designed and equipped for carriage by one or more modes of transport' => 'Talpyklos (konteineriai) (įskaitant talpyklas (konteinerius), skirtas skysčiams transportuoti), specialiai sukonstruotos ir pritaikytos gabenti vienos arba kelių rūšių transportu',
    'Tractors (other than tractors of heading 8709)' => 'Traktoriai ir vilkikai (išskyrus traktorius ir vilkikus, priskiriamus 8709 pozicijai)',
    'Motor vehicles for the transport of ten or more persons, including the driver' => 'Autotransporto priemonės, skirtos ne mažiau kaip dešimčiai žmonių, įskaitant vairuotoją, vežti',
    'Motor cars and other motor vehicles principally designed for the transport of persons (other than those of heading 8702), including station wagons and racing cars' => 'Automobiliai ir kitos autotransporto priemonės, daugiausia skirtos žmonėms vežti (išskyrus priskiriamas 8702 pozicijai), įskaitant lengvuosius keleivinius-krovininius automobilius (universalus) ir lenktyninius automobilius',
    'Motor vehicles for the transport of goods' => 'Autotransporto priemonės, skirtos kroviniams vežti',
    'Special purpose motor vehicles, other than those principally designed for the transport of persons or goods (for example, breakdown lorries, crane lorries, fire fighting vehicles, concrete-mixer lorries, road sweeper lorries, spraying lorries, mobile workshops, mobile radiological units)' => 'Specialios autotransporto priemonės, išskyrus daugiausia skirtas žmonėms arba kroviniams vežti (techninės pagalbos automobiliai, automobiliniai kranai, priešgaisriniai automobiliai, automobilinės betonmaišės, automobiliniai laistytuvai-valytuvai, automobilinės dirbtuvės, mobilios radiologijos stotys)',
    'Chassis fitted with engines, for the motor vehicles of headings 8701 to 8705' => 'Autotransporto priemonių, priskiriamų 8701–8705 pozicijoms, važiuoklės su pritvirtintais varikliais',
    'Bodies (including cabs), for the motor vehicles of headings 8701 to 8705' => 'Autotransporto priemonių, priskiriamų 8701–8705 pozicijoms, kėbulai (įskaitant kabinas)',
    'Parts and accessories of the motor vehicles of headings 8701 to 8705' => 'Autotransporto priemonių, priskiriamų 8701–8705 pozicijoms, dalys ir reikmenys',
    'Works trucks, self-propelled, not fitted with lifting or handling equipment, of the type used in factories, warehouses, dock areas or airports for short distance transport of goods; tractors of the type used on railway station platforms; parts of the foregoing vehicles' => 'Savaeigiai vežimėliai be kėlimo ir krovimo įrangos, naudojami gamyklose, sandėliuose, uostuose arba oro uostuose kroviniams trumpais nuotoliais vežti; traktoriai ir vilkikai, naudojami geležinkelio stočių platformose; išvardytų transporto priemonių dalys',
    'Motorcycles (including mopeds) and cycles fitted with an auxiliary motor, with or without side-cars; side-cars' => 'Motociklai (įskaitant mopedus), dviračiai ir panašios transporto priemonės su pagalbiniais varikliais, su priekabomis arba be jų; priekabos',
    'Bicycles and other cycles (including delivery tricycles), not motorised' => 'Dviračiai ir kitos pedalinės transporto priemonės (įskaitant transportinius triračius), be variklio',
    'Carriages for disabled persons, whether or not motorised or otherwise mechanically propelled' => 'Vežimėliai neįgaliesiems su varikliais arba be jų, su kitomis mechaninėmis pavaromis arba be jų',
    'Parts and accessories of vehicles of headings 8711 to 8713' => 'Transporto priemonių, priskiriamų 8711–8713 pozicijoms, dalys ir reikmenys',
    'Baby carriages and parts thereof' => 'Vaikų vežimėliai ir jų dalys',
    'Trailers and semi-trailers; other vehicles, not mechanically propelled; parts thereof' => 'Priekabos ir puspriekabės; kitos nesavaeigės transporto priemonės; jų dalys',
    'Balloons and dirigibles; gliders, hang gliders and other non-powered aircraft' => 'Oro balionai ir dirižabliai; sklandytuvai, skraidyklės ir kiti orlaiviai be variklių',
    'Other aircraft (for example, helicopters, aeroplanes), except unmanned aircraft of heading 8806; spacecraft (including satellites) and suborbital and spacecraft launch vehicles' => 'Kiti orlaiviai (pavyzdžiui, sraigtasparniai, lėktuvai), išskyrus 8806 pozicijai priskiriamus bepiločius orlaivius; erdvėlaiviai (įskaitant palydovus) ir suborbitinės bei erdvėlaivių paleidimo raketos',
    'Aircraft launching gear; deck-arrestor or similar gear; ground flying trainers; parts of the foregoing articles' => 'Orlaivių paleidimo mechanizmai; ant laivo denio nusileidžiančių lėktuvų stabdymo ir kiti panašūs įrenginiai; lakūnų treniruokliai; išvardytųjų įrenginių dalys',
    'Unmanned aircraft' => 'Bepiločiai orlaiviai',
    'Parts of goods of heading 8801, 8802 or 8806' => 'Prekių, priskiriamų 8801, 8802 arba 8806 pozicijai, dalys',
    'Cruise ships, excursion boats, ferry-boats, cargo ships, barges and similar vessels for the transport of persons or goods' => 'Kruizų laivai, ekskursijų laivai, keltai, krovininiai laivai, baržos ir panašios vandens transporto priemonės žmonėms arba kroviniams vežti',
    'Fishing vessels; factory ships and other vessels for processing or preserving fishery products' => 'Žvejybos laivai; plaukiojančiosios įmonės ir kiti laivai žvejybos produktams perdirbti arba konservuoti',
    'Yachts and other vessels for pleasure or sports; rowing boats and canoes' => 'Jachtos ir kitos vandens transporto priemonės, skirtos pramogoms arba sportui; irklinės valtys ir kanojos',
    'Tugs and pusher craft' => 'Vilkikai ir vilkikai-stūmikai',
    'Light-vessels, fire-floats, dredgers, floating cranes, and other vessels the navigability of which is subsidiary to their main function; floating docks; floating or submersible drilling or production platforms' => 'Plūduriuojantys švyturiai, priešgaisriniai laivai, žemsiurbės, plaukiojantieji kranai ir kiti specialūs laivai, kurių tinkamumas laivybai yra pagalbinė funkcija; plaukiojantieji dokai; plaukiojančiosios arba gramzdinamosios gręžybos arba verslinės-žvejybinės platformos',
    'Other vessels, including warships and lifeboats other than rowing boats' => 'Kiti laivai, įskaitant karinius laivus ir gelbėjimo laivus, išskyrus irklines valtis',
    'Other floating structures (for example, rafts, tanks, coffer-dams, landing stages, buoys and beacons)' => 'Kiti plaukiojantieji įrenginiai (pavyzdžiui, plaustai, rezervuarai, užtvankos, prieplaukos, plūdurai ir navigaciniai ženklai)',
    'Optical fibres and optical fibre bundles; optical fibre cables other than those of heading 8544; sheets and plates of polarising material; lenses (including contact lenses), prisms, mirrors and other optical elements, of any material, unmounted, other than such elements of glass not optically worked' => 'Šviesolaidžiai ir šviesolaidžių grįžtės; šviesolaidžių kabeliai, išskyrus priskiriamus 8544 pozicijai; poliarizacinių medžiagų lakštai ir plokštės; neaptaisyti lęšiai (įskaitant kontaktinius lęšius), prizmės, veidrodžiai ir kiti neaptaisyti optiniai elementai iš bet kurių medžiagų, išskyrus tokius elementus iš optiškai neapdoroto stiklo',
    'Lenses, prisms, mirrors and other optical elements, of any material, mounted, being parts of or fittings for instruments or apparatus, other than such elements of glass not optically worked' => 'Aptaisyti lęšiai, prizmės, veidrodžiai ir kiti aptaisyti optiniai elementai iš bet kurių medžiagų, kurie yra prietaisų arba aparatų dalys ar priedai, išskyrus tokius elementus iš optiškai neapdoroto stiklo',
    'Frames and mountings for spectacles, goggles or the like, and parts thereof' => 'Regėjimo korekcijos akinių, apsauginių (arba tamsių) akinių arba panašūs rėmeliai ir aptaisai bei jų dalys',
    'Spectacles, goggles and the like, corrective, protective or other' => 'Regėjimo korekcijos akiniai, apsauginiai (arba tamsūs) akiniai arba kiti akiniai',
    'Binoculars, monoculars, other optical telescopes, and mountings therefor; other astronomical instruments and mountings therefor, but not including instruments for radio-astronomy' => 'Binokliai, monokuliarai, kiti optiniai teleskopai ir jų tvirtinimo įtaisai; kiti astronomijos prietaisai ir jų tvirtinimo įtaisai, išskyrus radioastronomijos prietaisus',
    'Photographic (other than cinematographic) cameras; photographic flashlight apparatus and flashbulbs other than discharge lamps of heading 8539' => 'Fotoaparatai (išskyrus kino kameras); fotoblykstės ir fotoblyksčių lempos, išskyrus dujošvytes lempas, priskiriamas 8539 pozicijai',
    'Cinematographic cameras and projectors, whether or not incorporating sound recording or reproducing apparatus' => 'Kino kameros ir kino projektoriai, su garso įrašymo arba atkūrimo įrenginiais ar be jų',
    'Image projectors, other than cinematographic; photographic (other than cinematographic) enlargers and reducers' => 'Vaizdo projektoriai, išskyrus kino projektorius; fotografijos (bet ne kinematografijos) didintuvai ir mažintuvai',
    'Apparatus and equipment for photographic (including cinematographic) laboratories, not specified or included elsewhere in this chapter; negatoscopes; projection screens' => 'Fotolaboratorijų (įskaitant kino laboratorijas) aparatai ir įranga, nenurodyti kitoje šio skirsnio vietoje; negatoskopai, projekcijos ekranai',
    'Compound optical microscopes, including those for photomicrography, cinephotomicrography or microprojection' => 'Sudėtiniai optiniai mikroskopai, įskaitant mikrofotografijos, mikrokinematografijos arba mikroprojektavimo mikroskopus',
    'Microscopes other than optical microscopes; diffraction apparatus' => 'Mikroskopai, išskyrus optinius mikroskopus; difrakcijos aparatai',
    'Lasers, other than laser diodes; other optical appliances and instruments, not specified or included elsewhere in this chapter' => 'Lazeriai, išskyrus lazerinius diodus; kiti optiniai aparatai ir prietaisai, nenurodyti kitoje šio skirsnio vietoje',
    'Direction finding compasses; other navigational instruments and appliances' => 'Kompasai, naudojami krypčiai nustatyti; kiti navigacijos prietaisai ir aparatai',
    'Surveying (including photogrammetrical surveying), hydrographic, oceanographic, hydrological, meteorological or geophysical instruments and appliances, excluding compasses; rangefinders' => 'Topografijos (įskaitant fotogrametrinę geodeziją), hidrografijos, okeanografijos, hidrologijos, meteorologijos arba geofizikos matavimų prietaisai ir aparatai, išskyrus kompasus; tolimačiai',
    'Balances of a sensitivity of 5 cg or better, with or without weights' => 'Svarstyklės, kurių jautrumas ne mažesnis kaip 5 cg, su svareliais arba be svarelių',
    'Drawing, marking-out or mathematical calculating instruments (for example, drafting machines, pantographs, protractors, drawing sets, slide rules, disc calculators); instruments for measuring length, for use in the hand (for example, measuring rods and tapes, micrometers, callipers), not specified or included elsewhere in this chapter' => 'Braižybos, ženklinimo arba matematinių skaičiavimų prietaisai (pavyzdžiui, braižybos mašinos, pantografai, matlankiai, slankmačiai, braižiklinės, logaritminės liniuotės, diskiniai skaičiuotuvai); rankiniai ilgio matavimo prietaisai (pavyzdžiui, matuoklės ir tieslės (matuojamosios juostos), mikrometrai, slankmačiai), nenurodyti kitoje šio skirsnio vietoje',
    'Instruments and appliances used in medical, surgical, dental or veterinary sciences, including scintigraphic apparatus, other electromedical apparatus and sight-testing instruments' => 'Medicinos, chirurgijos, stomatologijos arba veterinarijos aparatai ir instrumentai, įskaitant scintigrafijos aparatus, kiti elektriniai medicinos aparatai ir instrumentai, naudojami regėjimui tikrinti',
    'Mechano-therapy appliances; massage apparatus; psychological aptitude-testing apparatus; ozone therapy, oxygen therapy, aerosol therapy, artificial respiration or other therapeutic respiration apparatus' => 'Mechanoterapijos prietaisai; masažo aparatai; psichologinio tinkamumo testų aparatai; ozono terapijos, deguonies terapijos, aerozolinės terapijos, dirbtinio kvėpavimo arba kiti kvėpavimo aparatai, naudojami terapijoje',
    'Other breathing appliances and gas masks, excluding protective masks having neither mechanical parts nor replaceable filters' => 'Kiti kvėpavimo prietaisai ir dujokaukės, išskyrus saugos kaukes be mechaninių dalių ir keičiamų filtrų',
    'Orthopaedic appliances, including crutches, surgical belts and trusses; splints and other fracture appliances; artificial parts of the body; hearing aids and other appliances which are worn or carried, or implanted in the body, to compensate for a defect or disability' => 'Ortopedijos įtaisai, įskaitant ramentus, chirurginius diržus ir vyturus; įtvarai ir kiti įtaisai, naudojami lūžiams gydyti; dirbtinės kūno dalys; klausos aparatai ir kiti įtaisai, dedami ant kūno, nešiojami arba implantuojami į kūną, skirti fiziniam trūkumui arba negaliai kompensuoti',
    'Apparatus based on the use of X-rays or of alpha, beta, gamma or other ionising radiation, whether or not for medical, surgical, dental or veterinary uses, including radiography or radiotherapy apparatus, X-ray tubes and other X-ray generators, high tension generators, control panels and desks, screens, examination or treatment tables, chairs and the like' => 'Aparatai, kurių veikimas pagrįstas rentgeno, alfa, beta gama arba kitos jonizuojančiosios spinduliuotės naudojimu, skirti arba neskirti naudoti medicinoje, chirurgijoje, stomatologijoje arba veterinarijoje, įskaitant radiografijos arba radioterapijos aparatus, rentgeno vamzdelius ir kitus rentgeno spinduliuotės generatorius, valdymo pultus, ekranus, tyrimų arba gydymo procedūrų stalus, krėslus ir panašią įrangą',
    'Instruments, apparatus and models, designed for demonstrational purposes (for example, in education or exhibitions), unsuitable for other uses' => 'Prietaisai, aparatai ir modeliai, pritaikyti demonstravimui (pavyzdžiui, mokymo metu arba parodose), netinkami naudoti kitiems tikslams',
    'Machines and appliances for testing the hardness, strength, compressibility, elasticity or other mechanical properties of materials (for example, metals, wood, textiles, paper, plastics)' => 'Mašinos ir prietaisai, skirti medžiagų (pavyzdžiui, metalų, medienos, tekstilės medžiagų, popieriaus, plastikų) kietumui, stiprumui, spūdumui, tamprumui arba kitoms mechaninėms savybėms tirti',
    'Hydrometers and similar floating instruments, thermometers, pyrometers, barometers, hygrometers and psychrometers, recording or not, and any combination of these instruments' => 'Hidrometrai (areometrai) ir panašūs plūdrieji matuokliai, termometrai, pirometrai, barometrai, higrometrai (drėgmėmačiai) ir psichrometrai, su rašytuvais arba be rašytuvų, ir bet kurios šių prietaisų tarpusavio kombinacijos',
    'Instruments and apparatus for measuring or checking the flow, level, pressure or other variables of liquids or gases (for example, flow meters, level gauges, manometers, heat meters), excluding instruments and apparatus of heading 9014, 9015, 9028 or 9032' => 'Prietaisai ir aparatai, skirti srautui (debitui), lygiui, slėgiui arba kitiems skysčių arba dujų kintamiesiems matuoti arba tikrinti (pavyzdžiui, srautmačiai, lygmačiai, manometrai, šilumomačiai), išskyrus prietaisus ir aparatus, priskiriamus 9014, 9015, 9028 arba 9032 pozicijai',
    'Instruments and apparatus for physical or chemical analysis (for example, polarimeters, refractometers, spectrometers, gas or smoke analysis apparatus); instruments and apparatus for measuring or checking viscosity, porosity, expansion, surface tension or the like; instruments and apparatus for measuring or checking quantities of heat, sound or light (including exposure meters); microtomes' => 'Fizinės arba cheminės analizės prietaisai ir aparatai (pavyzdžiui, poliarimetrai, refraktometrai, spektrometrai, dujų arba dūmų analizės aparatai); prietaisai ir aparatai, skirti klampumui, akytumui, plėtimuisi, paviršinei įtempčiai arba panašiems kintamiesiems matuoti ir tikrinti; šilumos, garso arba šviesos kiekių matavimo ir tikrinimo prietaisai ir aparatai (įskaitant eksponometrus); mikrotomai',
    'Gas, liquid or electricity supply or production meters, including calibrating meters therefor' => 'Dujų, skysčių ar elektros tiekimo arba gamybos kiekio skaitikliai, įskaitant jų kalibratorius',
    'Revolution counters, production counters, taximeters, milometers, pedometers and the like; speed indicators and tachometers, other than those of heading 9014 or 9015; stroboscopes' => 'Sukimosi dažnio tachometrai, gaminių skaitikliai, taksometrai, hodometrai, žingsniamačiai ir panašūs prietaisai; greitmačiai ir tachometrai, išskyrus priskiriamus 9014 arba 9015 pozicijai; stroboskopai',
    'Oscilloscopes, spectrum analysers and other instruments and apparatus for measuring or checking electrical quantities, excluding meters of heading 9028; instruments and apparatus for measuring or detecting alpha, beta, gamma, X-ray, cosmic or other ionising radiation' => 'Osciloskopai, spektro analizatoriai ir kiti kiekybinių elektros charakteristikų matavimo arba tikrinimo prietaisai ir aparatai, išskyrus skaitiklius, priskiriamus 9028 pozicijai; alfa, beta, gama, rentgeno, kosminės arba kitos jonizuojančiosios spinduliuotės matavimo arba registravimo prietaisai ir aparatai',
    'Measuring or checking instruments, appliances and machines, not specified or included elsewhere in this chapter; profile projectors' => 'Matavimo arba tikrinimo įrankiai, prietaisai ir mašinos, nenurodyti kitoje šio skirsnio vietoje; profilių projektoriai',
    'Automatic regulating or controlling instruments and apparatus' => 'Automatinio reguliavimo arba valdymo prietaisai ir aparatai',
    'Parts and accessories (not specified or included elsewhere in this chapter) for machines, appliances, instruments or apparatus of Chapter 90' => 'Mašinų, aparatų, prietaisų arba įrankių, priskiriamų 90 skirsniui, dalys ir reikmenys (nenurodyti kitoje šio skirsnio vietoje)',
    'Wristwatches, pocket-watches and other watches, including stopwatches, with case of precious metal or of metal clad with precious metal' => 'Rankiniai, kišeniniai ir kiti panašūs laikrodžiai, įskaitant chronometrus, kurių korpusai pagaminti iš tauriųjų metalų arba iš metalų, plakiruotų tauriaisiais metalais',
    'Wristwatches, pocket-watches and other watches, including stopwatches, other than those of heading 9101' => 'Rankiniai, kišeniniai ir kiti panašūs laikrodžiai, įskaitant chronometrus, išskyrus priskiriamus 9101 pozicijai',
    'Clocks with watch movements, excluding clocks of heading 9104' => 'Laikrodžiai (išskyrus rankinius, kišeninius ir kitus panašius laikrodžius) su rankinių, kišeninių ir kitų panašių laikrodžių mechanizmais, išskyrus laikrodžius, priskiriamus 9104 pozicijai',
    'Other clocks' => 'Kiti laikrodžiai (išskyrus rankinius, kišeninius ir kitus panašius laikrodžius)',
    'Time of day recording apparatus and apparatus for measuring, recording or otherwise indicating intervals of time, with clock or watch movement or with synchronous motor (for example, time-registers, time-recorders)' => 'Paros laiko registravimo aparatai ir laiko matavimo prietaisai, kiti registravimo aparatai arba rodytuvai su rankinių arba kišeninių laikrodžių arba kitų laikrodžių mechanizmais arba su sinchroniniais varikliais (pavyzdžiui, laiko registratoriai, laiko užrašymo įtaisai)',
    'Watch movements, complete and assembled' => 'Rankinių, kišeninių ir kitų panašių laikrodžių mechanizmai, sukomplektuoti ir surinkti',
    'Clock movements, complete and assembled' => 'Stalinių, sieninių, bokšto arba kitų panašių laikrodžių mechanizmai, sukomplektuoti ir surinkti',
    'Complete watch or clock movements, unassembled or partly assembled (movement sets); incomplete watch or clock movements, assembled; rough watch or clock movements' => 'Sukomplektuoti laikrodžių mechanizmai, nesurinkti arba iš dalies surinkti (laikrodžių mechanizmų rinkiniai); surinkti, tačiau nesukomplektuoti laikrodžių mechanizmai; nebaigti surinkti laikrodžių mechanizmai',
    'Watch cases and parts thereof' => 'Rankinių, kišeninių ir kitų panašių laikrodžių korpusai ir kitos jų dalys',
    'Clock cases and cases of a similar type for other goods of this chapter, and parts thereof' => 'Stalinių, sieninių, bokšto arba kitų panašių laikrodžių korpusai ir kitų panašių dirbinių, priskiriamų šiam skirsniui, korpusai bei kitos jų dalys',
    'Watch straps, watch bands and watch bracelets, and parts thereof' => 'Rankinių, kišeninių ir kitų panašių laikrodžių dirželiai, juostelės ir apyrankės bei jų dalys',
    'Other clock or watch parts' => 'Kitos laikrodžių dalys',
    'Pianos, including automatic pianos; harpsichords and other keyboard stringed instruments' => 'Fortepijonai ir pianinai, įskaitant pianolas ir kitus automatinius pianinus; klavesinai ir kiti klavišiniai styginiai instrumentai',
    'Other string musical instruments (for example, guitars, violins, harps)' => 'Kiti styginiai muzikos instrumentai (pavyzdžiui, gitaros, smuikai, arfos)',
    'Wind musical instruments (for example, keyboard pipe organs, accordions, clarinets, trumpets, bagpipes), other than fairground organs and mechanical street organs' => 'Pučiamieji muzikos instrumentai (pavyzdžiui, vamzdiniai klavišiniai vargonai, akordeonai, klarnetai, triūbos, dūdmaišiai), išskyrus mugių vargonėlius ir mechanines rylas',
